(27, 'Update Data Registrasi ', '2011-05-02 17:09:34', 'Thanks banget buat yang sudah menginformasikan terkait permasalahan ketidaksamaan data perolehan registran. ', '<p>Hai&nbsp; Marlboro Ambassadors,<br /><br />Thanks banget buat yang sudah menginformasikan terkait permasalahan ketidaksamaan data perolehan registran. <br /><br />Saat ini, tim teknisi kami sedang berusaha untuk terus memperbaiki sistem report dari data perolehan regitrasi tersebut.<br /><br />Masalah ini terjadi dikarenakan saat ini kami sedang melakukan perpindahan server aplikasi Match Mis Match tersebut. <br /><br />Untuk sementara, data perolehan registrasi yang muncul di BA Portal jangan dijadikan patokan utama.<br /><br />Namun, proses pencarian anggota, tetap dilanjutkan. TETAP SEMANGAT !<br /><br />Guna keperluan pelaporan, mohon untuk melakukan beberapa hal berikut:<br /><br />1. Lakukan upload data sehari sekali. Lakukan saat usai beraktivas seharian.<br /><br />2. Sebelum mengupload data, lakukan screen capture saat tampilan di iPad seperti berikut. (Terlampir)<br /><br /><img style="float: left; margin: 5px;" src="contents/uploads/photo.PNG" alt="" width="410" height="308" /><br /><br /><br />3. Setelah selesai, catat angka pada Pending Profile. Lalu, lakukan upload data.<br /><br />4. Kirimkan hasil screen capture dan pencatatan manual perolehan registrasi hari itu, kepada masing-masing Project Leader.<br /><br />5. Apabila masih ada kendala, mohon untuk menghubungi masing-masing Project Leader untuk dapat segera dilaporkan kepada Team Brightcom.<br /><br />Terima kasih</p>', NULL, '27.png', 1),
(29, 'Good Luck, Ryan!', '2011-05-11 14:23:39', 'Congrats buat Ryan Akbar Zaindi alias bro Ryan, Marlboro Ambassadors asal Surabaya. Pasalnya, Ryan baru saja diterima kerja di sebuah bank ', '<p><strong>Good Luck, Ryan!</strong><br /><br />Hai Boys and Girls,<br /><br />Breaking News!!!<br />Congrats buat <strong>Ryan Akbar Zaindi</strong> alias bro <strong>Ryan</strong>, Marlboro Ambassadors asal Surabaya. Pasalnya, Ryan baru saja diterima kerja di sebuah bank di Surabaya setelah melewati proses seleksi yang super ketat tat tat.... Mantab!<br /><br />Ryan akan segera "menikmati" rutinitas di bank tersebut dan telah mengajukan pengunduran diri per bulan Mei ini dari program Marlboro Ambassador ini. <br /><br />Terima kasih atas segala dedikasi dan juga achievment yang sudah dilakukan oleh Ryan selama sebulan terakhir ini. Goooood Job... Goooood Job... Gooood Job... *Sambil tepuk tepuk bahu....<br /><br /><img style="float: left; margin: 5px;" src="contents/uploads/R_Sandy.jpg" alt="" width="110" height="110" />Sebagai penggantinya, let''s give big applause to <strong>SANDY YUDA DWINANA</strong> alias <strong>Sandy</strong> yang akan segera menggantikan posisi Ryan.<br /><br />So, let''s continue our journey!<br /><br />Good Luck Ryan... Let''s rock &amp; roll Sandy...</p>', NULL, '29.jpg', 1),
(30, 'What To Wear, What To Wear...', '2011-05-13 14:10:10', 'Parties used to be more than just music and dancing. More than guys trying to pick up on girls. More than just who can stay sober the longest. ', '&lt;p&gt;Parties used to be more than just music and dancing. More than guys trying to pick up on girls. More than just who can stay sober the longest.&lt;br /&gt;Parties are the event for people to meet, put on the best outfit in their closet and have one hell of a good time.&lt;br /&gt;&lt;br /&gt;These days, girls put on their tank tops, shorts (soooooo short), 3 inch high heels, and they&#039;re set. Guys put on their jeans, shirts, hair gel, and they are ready to rock the dance floor.&lt;br /&gt;&lt;br /&gt;People, I am telling you... dress code is sacred! You have to know what kind of party you would like to attend, what kind of music the party is going to play, the kind of crowd who will come, etc, etc.&lt;br /&gt;Once you know what kind of party it is, take your time to prep yourself. Take a good long shower, spray some nice perfume, and start looking inside your closet.&lt;br /&gt;&lt;br /&gt;&lt;img style=&quot;float: left; margin: 5px; border: 5px solid black;&quot; src=&quot;contents/uploads/Amble Shoes.jpg&quot; alt=&quot;&quot; width=&quot;172&quot; height=&quot;116&quot; /&gt;&lt;img style=&quot;margin: 5px; border: 5px solid black; float: left;&quot; src=&quot;contents/uploads/seba_shoes.jpg&quot; alt=&quot;&quot; width=&quot;176&quot; height=&quot;117&quot; /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;For the dudes, jeans are always the safest choice. Go with straight and clean cut, DO NOT go for baggie or boot cut unless you&#039;re attending a party in 2001. DO NOT wear slippers and sandals unless it&#039;s a rave or beach party. For indoor parties, always, always, always wear shoes. Ankle leather boots are IN right now, Google for Amble Shoes or Seba Shoes. A simple Keds would work, but do not go for training shoes. There is no sun light inside the club, so don&#039;t wear hats and sun glasses.&lt;br /&gt;&lt;br /&gt;&lt;img style=&quot;margin: 5px; border: 5px solid black; float: left;&quot; src=&quot;contents/uploads/beach wear.jpg&quot; alt=&quot;&quot; width=&quot;180&quot; height=&quot;180&quot; /&gt;For outdoor parties, guys can play a lot with variety of casual outfit. Shorts and white tops are the best. For sandals, try on simple ones but play with colors. Sun glasses are your play ground. Ray Ban, Vans, Oakley, anything! Please do not use back packs, a simple postman bags are cute for you to carry on wallets, phones, towels, and extra tops.&lt;br /&gt;&lt;br /&gt;Now, ladies..... Where should I start? Hmmm.... Black leggings are soo last year. Unless you are brave enough to wear some printed leggings (which I encourage), please do so. If you wanna go for jeans, skinny jeans would work for those who have lean and slender body. For those full figured or slightly plus size, a boot cut would work. When it comes to jeans, I like it clean. I will not choose jeans with accent in the back pocket; it really adds some weight in that area.&lt;br /&gt;&lt;br /&gt;Shorts are meant to be in your bedroom or beach. Unless it&#039;s a black knitted cutting edge, Nikicio shorts, please don&#039;t wear it to indoor party. Skirts are more like it, but please do remember, the length of your skirt will impact the guys&#039; thoughts and imagination. If you are not comfortable, then it does not fit you well.&lt;br /&gt;&lt;br /&gt;For the tops, simple basic like tank top or Mango basic is really comfortable, but it calls basic, so it means you have to add some layer to wear it to parties. Cropped jacket, sheer material blazer, oversized cardigan, are several outer wear that you can put on.&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img style=&quot;margin: 5px; border: 5px solid black; vertical-align: middle;&quot; src=&quot;contents/uploads/Nikicio.jpg&quot; alt=&quot;&quot; width=&quot;400&quot; height=&quot;316&quot; /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;If you are more in to one piece type of girl, than simple dress is perfect. Little black dress is the must-have item in your closet. (X)SML has some cuties that you can put on. Cotton Ink is the choice for comfort. Nikicio has a whole collection in black and it is fabulous. Try to Google some local brands, they are great.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;img style=&quot;float: right; margin: 5px; border: 5px solid black;&quot; src=&quot;contents/uploads/Melissa shoes.jpg&quot; alt=&quot;&quot; width=&quot;160&quot; height=&quot;160&quot; /&gt;Last but not least, SHOES. Now this is essential. If you have Manolo Blahnik, Chanel Boots, Or Jimmy Choo&#039;s stiletto, please leave those at home. You dance at parties, so you wanna make sure you can actually dance (or even walk, for that matter). Dress would go perfectly with heels. Peep toes are also cute. Zara, Pull and Bear, and Charles and Keith have wide range of affordable choices. If you wanna go flats, then go flat... Melissa is my new favorite local brand. Wedges work in all condition, it adds your heights yet it&#039;s still comfortable.&lt;br /&gt;&lt;br /&gt;Well, that&#039;s about it... some things I have learned and seen in several parties I have attended. The most important thing is to be the most comfortable of you. Trust me, that is all you need. Now, go to your closet, start mix and matching, do a little shopping if needed.... And, have fun at Marlboro Parties!!!&lt;/p&gt;', NULL, '30.jpg', 1),
(31, 'Sundaze District Is Coming!', '2011-05-18 10:10:19', 'Walk through in a one of a kind district. Where you can chill, hang out, drink, shop and dance till you  to our groovy shaking house tunes in one spot.', '&lt;p&gt;&lt;strong&gt;&lt;br /&gt;Your Sunday Getaway is back!&lt;/strong&gt;&lt;br /&gt;Walk through in a one of a kind district. Where you can chill, hang out, drink, shop and dance &#039;till you  to our groovy shaking house tunes in one spot.&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;&quot;SUNDAZE DISTRICT &quot;&lt;/strong&gt;&lt;br /&gt;Sunday afternoon, May, 22 , 2011&lt;br /&gt;At Epicentrum walk, Jakarta &lt;br /&gt;&lt;br /&gt;Feat:&lt;br /&gt;Joe Claussell&lt;br /&gt;Bima Isman&lt;br /&gt;Jhudeth&lt;br /&gt;Ade Ferdian&lt;br /&gt;Johannes Taufan&lt;br /&gt;Adie&lt;br /&gt;Ardi&lt;br /&gt;P double&lt;/p&gt;&lt;p&gt;&lt;img style=&quot;margin: 5px; border: 5px solid black; vertical-align: middle;&quot; src=&quot;contents/uploads/banner jpeg marlboro lights sundaze.png&quot; alt=&quot;&quot; width=&quot;400&quot; height=&quot;327&quot; /&gt;&lt;/p&gt;', NULL, '31.png', 1),
(24, 'Marlboro Vibeology Academy ', '2011-04-04 10:37:55', 'Marlboro Vibeology Academy dimulai dengan berkumpulnya para kandidat Project Leaders di The Roemah7a, Lebak Bulus', '<p>15 Mar 2011<br /><br />Marlboro Vibeology Academy dimulai dengan berkumpulnya para kandidat Project Leaders di The Roemah7a, Lebak Bulus. Dimulai dengan pembukaan dan perkenalan dengan Marlboro Team, dilanjutkan dengan Ice Breaking dan Team Building bersama Ghita Utoyo sebagai facilitator. Setelah makan siang, acara berlanjut dengan materi-materi seperti Teamwork, Leadership dan Decision Making, yang dikemas dalam bentuk permainan-permainan interaktif yang mengasah kreativitas, kerjasama, dan juga penuh tawa.<br /><br />Menjelang sore, Triatmoko NJ bersama Bambang Tri Prasojo membawakan materi Performance Management yang memberikan gambaran mengenai target yang harus dicapai para Project Leaders selama program berlangsung. Setelah makan malam, para peserta diajak untuk merenung, refleksi diri dan bahkan ditantang untuk berani bermimpi di sesi Reflections/Contemplations bersama Regi Wahyu. Selesai sesi yang cukup mengharu-biru ini, para peserta diberi tantangan &ndash; masing-masing harus membuat presentasi atau performance yang menunjukkan potensi dirinya, yang akan ditampilkan keesokan harinya.<br /><br />&nbsp;16 Mar 2011<br /><br />Pagi itu kantor HM Sampoerna di One Pacific Place mendapatkan 12 tamu istimewa &ndash; para kandidat Project Leaders menjalani hari ke dua mereka di lantai 18. Selama setengah hari mereka mendapatkan materi Project Management yang dibawakan oleh Regi Wahyu.<br /><br />Sementara itu, menjelang siang di Hotel Santika Premier juga berdatangan 65 kandidat Brand Ambassadors dari 5 kota: Jakarta, Bandung, Jogjakarta, Surabaya dan Medan.<br /><br />Sore itu Jakarta mendadak diguyur hujan lebat dan angin kencang, sehingga rencana makan malam Brand Ambassador ke Bebek Bengil Menteng diubah &ndash; kandidat Brand Ambassador langsung diberangkatkan ke Hotel Shangri La untuk bersiap mengikuti Opening Ceremony. Setibanya di Hotel Shangri La para kandidat Project Leader sudah siap menyambut para kandidat Brand Ambassador.<br /><br />Sebelum memasuki Ballroom untuk Opening Ceremony, seluruh kandidat Brand Ambassador dan Project Leader diajak untuk Ice Breaking dan Team Bonding bersama Ghita Utoyo. Setelah menemukan teman-teman sekelompoknya dan membuat yel kelompok, para peserta digiring masuk ke Ballroom.<br /><br />Opening Ceremony Marlboro Vibeology Academy dimulai dengan prosesi masuknya para peserta ke dalam Ballroom diiringi sambutan musik dan tepuk tangan meriah Marlboro Team. Acara dibuka oleh MC Ben Kasyafani, dilanjutkan dengan opening speech oleh Baba Hazuria dan kata sambutan dari Fumicko Rustantra, yang juga memperkenalkan para special trainers yaitu Doni Priliandi, Regi Wahyu dan Ghita Utoyo, juga Rene Suhardono dan Eliseo Font Raket yang berhalangan hadir.<br /><br />Acara dilanjutkan dengan Team Building yang dibawakan oleh Ghita Utoyo, di antaranya permainan &ldquo;Shipwreck Ocean&rdquo; di mana setiap kelompok peserta harus bertahan berada di atas selembar kertas besar yang menjadi perahu mereka, sementara ada para &ldquo;ikan hiu&rdquo; dan &ldquo;angin badai&rdquo; yang siap menghancurkan perahu. Permainan berikutnya adalah &ldquo;Hands Knot&rdquo; yang cukup mengocok perut karena tangan peserta yang kusut harus dapat &lsquo;diurai&rsquo; menjadi lingkaran besar.<br /><br />Setelah kedua permainan tersebut, acara dilanjutkan dengan &ldquo;Ensemble Choir&rdquo; yang riuh dan seru. Sebelum menutup acara, Ghita memutar sepotong video dengan tema &ldquo;Facing The Giant&rdquo; yang cukup membakar semangat para kandidat untuk dapat mencapai sesuatu yang lebih dari kemampuan.<br /><br />&nbsp;17 Mar 2011<br /><br />Hari itu pertama kalinya seluruh peserta berkumpul bersama untuk mengikuti sesi-sesi training. Di hari pertama ini materi yang dibawakan adalah materi dari Team Marlboro yaitu: Brand Knowledge, Compliance &amp; Tobacco Issues, Program Knowledge dan Tools &amp; Infrastructure. Setelah seluruh materi selesai, sore harinya dilanjutkan dengan Teamwork oleh Ghita Utoyo dan Danti Boediono, serta Game Plan oleh Regi Wahyu dan Triatmoko NJ.<br /><br />Seusai training, seluruh peserta makan malam bersama di Marley, Energy Tower dan ternyata di sini para &lsquo;artis&rsquo; menampilkan kebolehannya tampil di panggung live music menyanyikan beberapa lagu, dan seluruh peserta ikut bernyanyi bersama.<br /><br />Ternyata malam itu ada sedikit kejutan untuk para peserta &ndash; Team Marlboro memberikan satu surprise assignment. Masing-masing peserta dan masing-masing kota harus menyiapkan satu penampilan yang membuktikan kenapa mereka berhak untuk menjadi Brand Ambassador atau Project Leader.<br /><br />18 Mar 2011<br /><br />Di hari ini, materi yang dibawakan adalah behavior competencies dan para trainernya pun istimewa: Eliseo Font Raket membawakan materi Planning &amp; Organizing, Doni Priliandi membawakan Community Networking, Ghita Utoyo dengan Communications &amp; Influencing Others, dan Rene Suhardono dengan Creative Thinking.<br /><br />Seusai materi, seluruh peserta bersiap-siap untuk Group &amp; Individual Performance. Di sini giliran panitia dan trainers yang tertawa melihat keunikan dan kreativitas para peserta, karena masing-masing menampilkan dirinya dengan cara yang seru, unik dan berbeda.<br /><br />Seusai Group &amp; Individual Performance, para peserta dibawa ke Hotel Santika Premier untuk bersiap-siap makan malam di Bloeming&rsquo;s fX. Di sini peserta kembali diingatkan bahwa this is the greatest moment in my life &ndash; bahwa mereka sudah berkumpul dan belajar dan mendapatkan pengalaman berharga.<br /><br />Dari Bloeming&rsquo;s, para peserta dibawa ke X2 Club Senayan untuk mengikuti Inauguration dan Closing Ceremony. Di sini, MC P Double mengumumkan dulu para pemenang Best Performers Individual yaitu: Dhannisa Nurfira (Jakarta), Marshella Safira (Bandung), Ryant Akbar Zaindi (Surabaya), Shaffira Sasmita (Jogjakarta) dan Tubagus Baron (Medan).<br /><br />Karena para peserta sudah tidak sabar, MC langsung menunjuk big screen dan diputarlah video yang menampilkan beberapa foto-foto dari mulai saat wawancara, kedatangan di Jakarta, kegiatan training dan akhirnya ditampilkanlah foto-foto dan nama para Brand Ambassador dan Project Leader terpilih, diiringi tepuk tangan meriah.</p>', NULL, '24.jpg', 1),
(28, 'Bagi-Bagi Cerita Yuk.  ', '2011-05-04 15:43:41', 'Whats up! Buat kamu yang udah mulai suka ber-hang out ria di acara-acara Marlboro di Jakarta, Bandung, Medan, Surabaya dan Yogyakarta...', '<p class="MsoNormal"><span lang="EN-US">Hai Fantastic People! </span></p><p class="MsoNormal"><span lang="EN-US">What&rsquo;s up! Buat kamu yang udah mulai suka ber-<em>hang out</em> ria di acara-acara Marlboro di Jakarta, Bandung, Medan, Surabaya dan Yogyakarta, nggak usah malu-malu dong&hellip;buat meng <em>upload</em> foto-foto narsis kalian di BA Space ini.</span></p><p class="MsoNormal"><span lang="EN-US">This  place only for you! This place only for crazy people like you.. :D&nbsp;  Show to us how crazy you are in every Marlboro event&hellip;..&nbsp;&nbsp; </span></p><p class="MsoNormal"><span lang="EN-US">Not only upload the picture, but you can also make a story and share it to us&hellip;. </span></p><p class="MsoNormal"><span lang="EN-US">Just write your experience in email, and send it to us: <br />info@ba-space.com </span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p class="MsoNormal"><span lang="EN-US">Thanks. </span></p><p class="MsoNormal"><span lang="EN-US">Marlboro Teams</span></p>', NULL, '28.jpg', 1),
(32, 'Tambah Ornamen Marlboronya Dong... ', '2011-05-25 14:58:10', 'Finally, Marlboro VIBE event diselenggarakan juga di kota bandung. Event ini bertempat di Embassy Club, di dalam kawasan perbelanjaan  Ciwalk ,Bandung dan dimulai pada pukul 22.00 WIB', '<p>Finally, Marlboro VIBE event diselenggarakan juga di kota bandung. Event ini bertempat di Embassy Club, di dalam kawasan perbelanjaan&nbsp; Ciwalk ,Bandung dan dimulai pada pukul 22.00 WIB. Animo dan antusias masyarakat bandung dalam event ini sudah terlihat&nbsp; pada saat dimulainya acara, tampak di halaman depan telah berdatangan komunitas-komunitas seperti komunitas BMW, dan party goers lainnya.<img style="float: right; margin: 5px; border: 5px solid black;" src="contents/uploads/guest stars 2.JPG" alt="" width="240" height="160" /><br /><br />Team VIBE dari kota Bandung yang diwakili oleh Project Leader (indra /bengol) beserta para Brand Ambassadors (shella, budi, ray, faiz, kaka, hendi, abim,dan echa) ikut serta untuk memeriahkan event ini. Selain itu , event ini dijadikan sebagai ajang &ldquo;engagement&rdquo; oleh para Brand Ambassadors dalam hal ini shella, kaka, dan echa, dengan membawa perwakilan &ndash;perwakilan dari komunitas yang telah mereka register terlebih dahulu dan dilibatkan dalam event VIBE ini. Semua engagement yang terjadi dalam event ini adalah salah satu bentuk perwujudan misi tim VIBE Bandung untuk melakukan engagement kepada semua komunitas yang telah mereka approach sebagai &ldquo;target operasi&rdquo; dan sebagai bentuk pertanggungjawaban kami atas tujuan dari program VIBE Marlboro ini.<br /><br />Shella membawa Iqbal ,perwakilan dari komunitas fotografi dengan spesialisasi fashion and band photography, selain itu shella juga membawa Vera, perwakilan dari komunitas make-up artist,fashion and band.<br /><br /><img style="float: left; margin: 5px; border: 5px solid black;" src="contents/uploads/kakas engagements with rebellion.JPG" alt="" width="240" height="160" />Kaka membawa perwakilan komunitas online gamers (rebellion) yang terdiri atas Jimmy ,Adjie,dan Wesa, tapi mereka bukan hanya gamers lho, mereka juga hang outers, and trip maker.<br /><br />Echa membawa perwakilan komunitas halaman belakang/ backyarder yang terdiri dari Anne, Novi, Wanda, Monica, dan Arya (salah satu calon BA Bandung pada saat training Vibeology). Aktivitas mereka antara lain sebagai party goers , trip maker , dan sangat hobi hang out bareng.<br /><br />Selain melakukan engagement, tim VIBE Bandung mengadakan small re dengan melibatkan Dinda, Gilang dan Arya (para calon BA Bandung pada saat training Vibeology) dan sebagai bentk bahwa event ini sangat terbuka untuk siapa saja yang punya interest tinggi terhadap seluruh rangkaian event VIBE Marlboro.<br /><br />Seluruh perwakilan dari komunitas yang telah disebutkan diatas kami blend dalam event ini, dan mereka pun berinteraksi satu sama lain,bahkan saling bertukar informasi mengenai aktivitas mereka dan tetap menjaga komunikasi didalam event ini ato diluar event ini sekalipun.<br /><br />Last but not least, this event was so cool !.Mungkin hanya kurang meriah ornament-ornamen Marlboro nya, jadi belum terlihat eksklusivitas dari event ini. Untuk itu semoga ke depan nya lebih happening dan lebih amazing lagi untuk lebih membangkitkan interest komunitas yang lainnya untuk ikut terlibat, sudah tentu dengan tim VIBE Bandung berada di dalamnya !!<br /><br />SALAM VIBE DARI KAMI !! SEE YA ALL IN THE NEXT EVENTS !!<br /><br />story by: Indra Saldy(Project Leader)</p>', NULL, '32.jpg', 1),
(34, 'Sundaze Surprising Sound!', '2011-05-27 16:29:02', 'Dis is one of one thousands saying about Sundaze that i might get. As we know, Sundaze- from year to year- has exclusive big fans. Temanya berbeda-beda dan unik. ', '<p>"As usual. Sundaze event always presents fabolous show from A-z. The venue and crowd was cool...! Meet my old friend, new friend... It feels good to see em! And of course MArlboro lounge. I can get comfy in marlboro lounge. Like a vip guest, because we know the venue was lil bit small (i thought). But anyway, thanks so much, Marlboro! Amazing sunday!<br />(Okky Nugraha, 22 tahun, Universitas Trisakti)<br /><br /><strong>Sundaze Superb!<br /></strong>Dis is one of one thousands saying about Sundaze that i might get. As we know, Sundaze- from year to year- has exclusive big fans. Temanya berbeda-beda dan unik. It has gud and superb positioning for the young folks. And it comes again on may 22 th 2011. We can see the urban atmosphere that built around skyscrapers. Light goes up and down when dj was playing d marvelous sounds. So, what r u waiting for? Dancing till u dance in stop motion!</p><p style="text-align: center;"><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/sundaze1danissa.jpg" alt="" width="380" height="214" /><em><strong><br />Groove you&rsquo;re Sunday!<br /></strong></em></p><p style="text-align: left;"><strong><br />Sundaze Small (venue) but Sophisticated (day)<br /></strong>"Gila Sundaze gokil banget. Rame banget. Biarpun tempatnya sempit tapi makin intim. Udah lama bgt gue ga ke SUndaze, walaupun tempatnya kecil... Ampe gue bela-belain naik sepeda ke sana. Yang penting gue dateng ke sana gokiiiilllll..." <br />Karfianda suryoutoro, 24 thn, Universitas Indonesia)<br />(you can hear the voice note by bbm if it''s needed :p)<br /><br />Some ppl say that the venue was a lil bit small, but it was extravaganza! Sampai-sampai gue bisa denger temen gue berkali-kali teriak dengan kata "gokil"..."gokil". He kept going on though his bike was on terrible. Yeah, he loves fixie, but he loves party. Dan setiap gue mengajak temen-temen gue ke Marlboro lounge, mereka terlihat very excited. Dan mereka pun nggak melewatkan kesempatan untuk menikmati space lainnya di Sundaze. Like their own home, they went surround there and they were back to the Marlboro Lounge. Bahkan diantara musik dj yang memenuhi lounge, mereka sempet nyeletuk "Ajak-ajak lagi dong kalau ada acara Marlboro dan" :)<br /><em><strong><br /></strong></em></p><p style="text-align: center;"><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/sundaze2danissa.jpg" alt="" width="380" height="214" /></p><p style="text-align: center;"><em><strong>The Sun goes under with the sound</strong></em></p><p style="text-align: left;"><br /><strong>SUNDAZE. Smashing the Silence<br /></strong>We know we''ve been in a rush. Jakarta is always on hurriedness. We walk, run, jump till we fly to reach the cloud. Monday-tues-wed-thurs-fri-sometimes we have saturday. Setelah melewati begitu sibuknya jadi anak kuliahan atau para pekerja urban, kita selalu butuh hari minggu. And like singing song "Sunday morning rain is falling...". Hari minggu yang menyenangkan kemarin, memang diguyur hujan dengan sedikit macetnya kota Jakarta. Tapi nggak menggagalkan niat para pecinta fashion-art and music untuk berkelana di Sundaze District. Berbagai sudut memberikan warna tersendiri. Fashion, art show dan music stage melengkapi kebutuhan pengunjung. Eyesgarsm-Earsgasm- (and whatsoever) . We''ve got it from the district. And it stuck on our minds. The most important is, we got boss experience from the district. <br /><br />Light up your soul wif...<br /><strong>Sundaze District, Sunday break!<br /></strong><br />story by Dhanissa N.</p>', NULL, '34.jpg', 1),
(33, 'Can\\''t Wait for the Next Sundaze!', '2011-05-25 15:36:06', 'Perjalanan gw ke sundaze minggu sore tanggal 22 Mei sedikit terhambat.\r\nDikarenakan hujan yang sangat deras mengguyur Jakarta', '<p>Perjalanan gw ke sundaze minggu sore tanggal 22 Mei sedikit terhambat.<br />Dikarenakan hujan yang sangat deras mengguyur Jakarta. apalagi dapet kabar dr erika BA dr Jakarta kalo hujannya deres banget dan berpetir di epicentrum. baiklah sabar.. (walaupun udh gak sabar mau lgsg disko":p)<br /><br />Yak.. hujan mereda! meluncurlah gw kesana dan tiba di venue jam 7.<br />suasana msh sedikit gerimis tapi sudah ramai sekali crowdnya.<br />dresscode hari itu adalah urban style, dikarenakan sundaze kali ini mengambil tema district. yg kalo menurut intrepetasi gw, sundaze kali ini mau mengambil semangat sosialita urban yang selalu sibuk dengan segudang aktivitas, namun selalu punya kesempatan untuk bersenang"<br />bersama teman-teman. yaa istilah umumnya: "work hard, party hard"<br /><br />Yaa jalan sana jalan sini.. ketemu temen disana sini.. liat artwork di berbagai sudut venue yang masih dengan semangat urban. tak lupa juga foto di salah satu sudut photobooth yg telah disediakan. taklupa juga ke marlboro lounge, ketemu BA-BA dr Jakarta dan tim brightcomm dan tak lupa juga org" dari phillip morris :)<br /><br />Musiknya seru, joe claussell seru, minumannya seru, crowdnya seru, happening artnya seru, temen-temen yang dateng kesana gak kalah seru.<br />I had such a really good time there. cant wait for the next sundaze yg mudah"an msh terus di sponsorin marlboro yaah :D hidup sundaze! hidup marlboro! *plak*</p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/DSC03312.jpg" alt="" width="380" height="271" /></p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/DSC03296.jpg" alt="" width="380" height="214" /></p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/DSC03283.jpg" alt="" width="380" height="214" /></p><p>story by: Winnie Ariane (Brand Ambassador)</p>', NULL, '33.jpg', 1),
(35, 'The Acoustic Music of Mikes Apartment.', '2011-06-16 22:35:26', 'Feel the Sunday Sounds. Serentak para Mikes followers bernyanyi mengkuti alunan gitar akustik dan suara sang vokalis, Dendy. Bersama musik, mereka melebur.', '<p><em><strong>&ldquo;Someone likes you and all you know and how you speak</strong></em><br /><em><strong>countless lovers undercover of the streets</strong></em></p><p><em><strong>You know that I could use somebody...</strong></em><br /><em><strong>you know that I could use somebody...&rdquo;</strong></em></p><p><br /><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes1.jpg" alt="" width="380" height="250" /></p><p style="text-align: center;"><strong><em>Singing together</em></strong></p><p>Serentak para Mike&rsquo;s followers bernyanyi mengkuti alunan gitar akustik dan suara sang vokalis, Dendy. Bersama musik, mereka melebur. Terlihat seakan-akan sebuah ruangan terisi oleh orang-orang yang sudah sangat mengenal dekat.</p><p>Hari Minggu, tepatnya 12 Juni 2005, di 365 kemang Jakarta, para followers Mike berkumpul menyaksikan sajiian musik oleh Mike&rsquo;s Apartment. Tak bosan, meskipun sering menikmati acara musik dengan Mike&rsquo;s sebagai guest star di tempat lainnya seperti The Trip, Imigrant, Poste dan lain-lain, mereka tetap asik bernyanyi dan bergoyang dengan meniupkan kepulan di udara.</p><p>Mike&rsquo;s Apartment terbentuk di awal tahun 2005 dengan formasi Dendy (vocal), Udin (gitar, vocal), Marko (d-box, percussion, vocal), Bagus (Bass). Konsep yang mereka tawarkan adalah live akustik dengan mambawakan lagu-lagu aliran early 90&rsquo;s alternative pop rock seperti, radiohead, smashing pumpkins, u2, the beatles, stone temple pilots, better than ezra, coldplay, dan juga lagu-lagu lokal seperti slank.</p><p>Acara tersebut diadakan oleh sebuah Radio Station dan disponsori oleh produk kontrasepsi. Dihadiri oleh para pencinta Mike&rsquo;s yang tentunya adalah para kaum urban yang mengapresiasi musik dan seni. Saya menciptakan kesempatan berharga ini untuk membangun sebuah jalinan sosial dengan para penggemar Mike&rsquo;s dan para KOL (key opinion leader) yang notabenenya adalah teman-teman yang sudah membantu saya banyak dalam proses akuisisi selama dua bulan terakhir; dan tentunya membuat jaringan sosial Saya lebih luas lagi.</p><p style="text-align: left;">Angie ( owner Inch of Mesa; art and design clothing brand), Ricardo Suwandy (Manchester United Indonesia, Future StreetBall, Stwetball community), dan Kitty Mannu (Manager of Mike&rsquo;s Apartment) adalah tiga orang yang sekaligus Saya ajak untuk berkumpul dan berkenalan satu sama lain. Fortunately, Angie dan Edo juga merupakan dua dari sekian penikmat musik Mike&rsquo;s Apartment. Like our friendship principe: we meet. We melt. We minggle. And i think, it&rsquo;s well done.<br /><br /></p><p style="text-align: center;"><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes2.jpg" alt="" width="380" height="314" /><em><strong>Bersama para KOL.</strong></em><br /><em><strong>Kiri ke kanan: Ricardo Suwandy, Angie, Me!, Kitty Manu</strong></em></p><p><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes3.jpg" alt="" width="380" height="276" /></p><p style="text-align: center;"><em><strong>Meet. Melt. Minggle.</strong></em><br /><em><strong>Kiri ke kanan: Ricardo Suwandy, Angie, Me!, Kitty Manu</strong></em></p><p>Lebih lagi, di sana Saya dapat melakukan akuisisi dengan followers Mike&rsquo;s; sang MC, Hans Berly Lango, yang sudah terkuyung-kuyung bukan hanya karena kelelahan bercuap-cuap di acara, tetapi juga karena minuman yang disajikan untuknya (yeah, we&rsquo;re Rendezbooze at that time :p) ; hingga berakusisi dengan anggota Mike&rsquo;s sendiri. Dan mereka terlihat interested dengan games MixMatch, apalagi kebanyakan karakter hasil akhir sesuai dengan karakter mereka masing-masing.</p><p><br /><img style="vertical-align: middle; display: block; margin-left: auto; margin-right: auto;" src="contents/uploads/mikes4.jpg" alt="" width="380" height="355" /><br /><strong>Times to Acquisition</strong></p><p>Superb! Penampilan Mike&rsquo;s memang membius para followers. Terlihat, para followers Mike&rsquo;s memang pencinta musik akustik dan alternative 90&rsquo;an sejati. Tapi tentunya mereka bukan penikmat yang rusuh; they looks cool, confident and full of power.</p><p><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes5.jpg" alt="" width="380" height="271" /><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes6.jpg" alt="" width="380" height="244" /><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes7.jpg" alt="" width="380" height="299" /></p><p>At the end of this fantabulous nite, I got a chance to chitchat and taking photos with Mike&rsquo;s. They cordially introduced themselves and asked me to join another time.</p><p><br /><img style="vertical-align: middle; margin: 5px auto; border: 5px solid black; display: block;" src="contents/uploads/mikes8.jpg" alt="" width="380" height="252" /></p><p style="text-align: center;"><em><strong>Hello! We are Milke&rsquo;s ! (Including me and Kitty)</strong></em></p><p>Thanks Mike&rsquo;s, Kitty, Angie and Edo; and of course all of Mike&rsquo;s followers. See ya soon, in another Music Blast! <br /><br /><br />Regards<br />Dhannisa Nurfira<br />Brand Ambassador Jakarta</p>', NULL, '35.jpg', 1);
INSERT INTO `gm_article` (`id`, `title`, `posted_date`, `brief`, `detail`, `attachment`, `img`, `categoryID`) VALUES
(36, 'Minuman Keras Terkenal Di Berbagai Negara', '2011-06-24 02:07:39', 'Sebelum kalian ikutan event Marlboro dan party all night long, kayaknya lo harus pada tau dulu minuman keras apa aja yang ada di dunia.', '<p>Dibawah ini adalah beberapa daftar Minuman Keras yg terkenal di seluruh dunia.<br /><br /><strong>Mojito, Kuba</strong></p><p><img src="contents/uploads/minuman%20keras%20[geghans].jpg" alt="" /></p><p>Minuman beralkohol adalah minuman yang mengandung etanol. Etanol itu bahan psikoaktif dan yang kalo lo konsumsi menyebabkan penurunan kesadaran. Di berbagai negara, penjualan minuman beralkohol dibatasi ke sejumlah kalangan aja, biasanya buat orang-orang yang telah melewati batas usia tertentu.</p><p>Dibawah ini adalah beberapa daftar minuman keras yg terkenal di seluruh dunia.</p><p><strong><br />Mojito, Kuba</strong></p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/133477968_a33c681fe5.jpg" alt="" width="375" height="500" /></p><p>Minuman tradisional asal Kuba ini telah berkembang menjadi salah satu minuman favorit di Amerika sana. Katanya sih racikan aslinya terdiri dari rum, daun mint, air berkarbonat, dan jus manis kalengan. Namun, jaman sekarang racikannya sudah dimodifikasi dengan penambahan buah-buahan seperti blueberry, raspberry, peach, dan delima menyesuaikan dengan kebutuhan penikmatnya :)</p><p><strong><br />Sake, Jepang dan China</strong></p><p><img src="contents/uploads/fo_fuks_sake.jpg" alt="" /></p><p>Sake erat kaitannya dengan keningratan. Minuman berbahan dasar air beras hasil fermentasi ini biasanya dihidangkan dengan sushi atau penganan Asia lainnya. Sake enak banget dinikmati hangat maupun dingin, biasanya disuguhkan dalam sakazuki (cawan kecil datar, seperti tempat saus), ochoko (cawan mungil), atau ditaruh dalam masu (kotak kayu). Sake juga sering dipakai dalam upacara adat Jepang.</p><p><strong><br />Pisco Sour, Peru dan Chile</strong></p><p><img src="contents/uploads/8_pisco_sour.jpg" alt="" /></p><p>Nah kalo minuman keras ini merupakan hasil penyaringan buah anggur, yang diproduksi di Peru dan Chile. Minuman ini dikombinasi dengan brandy, sirup, jus lemon, dan putih telur. Katanya sih seringkali disajikan dalam gelas anggur model dulu. Di Chile, minuman ini kadang dicampur dengan coke dalam penyajiannya. Hmm kenapa harus dicampur coke dulu ya? :)</p><p><strong><br />Brennivin, Islandia</strong></p><p><img src="contents/uploads/2544810328_a0844b8f08.jpg" alt="" /></p><p>Berani taruhan, kalo lo bisa minum minuman ini tanpa meringis, berarti lo lebih kuat dari kebanyakan orang Islandia yang pernah nyobain minuman ini. Minuman keras Skandinavia ini terbuat dari kentang lembek yang difermentasi, dan biji-biji tanaman. Brennivin ini biasanya diminum dan ditemani 2 hidangan -yang katanya- lezattapi antik seperti rotted shark meat (daging hiu yang dibusukkan lalu dibakar dan dijemur hingga kering supaya racunnya hilang) dan hakarl (daging hiu yang difermentasi). Berani coba? Haha.<strong><br /><br />Soju, Korea Selatan dan Jepang</strong></p><p><img src="contents/uploads/soju.jpg" alt="" /></p><p>Soju, minuman Asia lainnya yang juga adalah hasil dari air beras yang difermentasiin. Minuman ini mengandung alkohol kurang dari 35%, seperti yang ditetapkan oleh peraturan pemerintahnya. Menurut kebiasaan, biasanya minuman ini dikonsumsi beramai-ramai dan lo ga dibolehin ngisi gelas lo sendiri, harus ada orang lain yang nuangin. Entah apa maksudnya tapi adatnya seperti itu bro. Saat lo mulai minum, lo harus minum sampai tetes terakhir aka habisin sampe abis sekali teguk bro.</p><p><strong><br />Negroni, Italia</strong></p><p><img src="contents/uploads/negroni.jpg" alt="" /></p><p>Italia yang terkenal dengan minuman wine-nya, ternyata juga terkenal dengan koktail manisnya. Minuman beralkohol ini campuran antara vermouth (sejenis air anggur yang putih atau agak kuning warnanya), gin dan Campari. Biasanya minuman ini disajikan dengan potongan lemon atau kulit jeruk di dalamnya. Kayaknya sih enak :)</p><p><strong><br />Singapore Sling, Singapura</strong></p><p><img src="contents/uploads/genimage.jpg" alt="" /></p><p>Katanya sih resepnya telah banyak mengalami perubahan dari resep aslinya pada awal tahun 1900an. Menurut resep aslinya, minuman ini merupakan campuran gin, brandy ceri dan benedictine yang dikocok. Trus penyajiannya dipermanis dengan soda, grenadine, jus nanas, atau Cointreau, disesuaikan dengan selera pemesannya. Kalian ada yang pernah minum minuman ini?</p><p><strong><br />Akvavit, Denmark</strong></p><p><img src="contents/uploads/93.jpg" alt="" width="250" height="348" /></p><p>Arti namanya adalah air kehidupan. Minuman beralkohol ini bisa jadi bahaya buat lo semua kalo lo ga hati hati pas minum minuman ini. Kadar alkoholnya lumayan tinggi. Akvavit (atau ''Aquavit'') didapet dari penyaringan air beras atau kentang, seperti vodka, plus ditambah dengan unsur herbal kayak ketumbar, biji adas, dan dill (tumbuh-tumbuhan yang bijinya harum dipakai untuk asinan, masak-masakan, minyak wangi dan obat-obatan). Wow.</p><p><strong><br />Caipirinha, Brazil</strong></p><p><img src="contents/uploads/caipirinha.jpg" alt="" width="400" height="396" /></p><p>Nah ini nih minuman koktail nasional di Brazil, merupakan kombinasi antara Cachaca (sejenis rum, terbuat dari sirup sugarcane), gula dan limau. Biasanya sih disajiin dalam gelas standard model dulu, beserta dengan potongan kulit jeruk dan lebih nikmat bro kalo dicampur es batu. Slurpppp.</p><p><strong><br />Sangria, Spanyol dan Portugal</strong></p><p><img src="contents/uploads/Sangria.jpg" alt="" /></p><p>Walau asalnya dari Spanyol, tapi minuman ini lebih populer di kalangan bule asing daripada di penduduk aslinya. Air anggur manis berpadu dengan campuran buah adalah resep asli minuman ini.</p><!--[if !mso]><style>v\\:* {behavior:url(#default#VML);}o\\:* {behavior:url(#default#VML);}w\\:* {behavior:url(#default#VML);}.shape {behavior:url(#default#VML);}</style><![e