(37, 'Berlibur Ke Pantai Senggigi', '2011-06-30 09:19:07', 'Pantai Senggigi adalah tempat pariwisata yang terkenal di Lombok. Letaknya di sebelah barat pesisir Pulau Lombok. Pantai Senggigi memang tidak sebesar Pantai Kuta di Bali, tetapi seketika kita berada di sini akan merasa seperti berada di Pantai Kuta, Bali.', '<p>Kalo lo pernah ngebayangin tubuh lo terbaring di pinggir pantai indonesia, di atas pasir putih yang indah, ditaburi pemandangan alam yang serba eksotis, serta dihujani cahaya mentari yang menghangatkan tubuh, maka gak salah kalo lo nyempetin diri berekreasi dan ber wisata Pantai ke Senggigi di Pulau Lombok, Nusa Tenggara Barat. Pantai yang terletak 12 kilometer di sebelah barat laut Kota Mataram ini memang merupakan obyek wisata yang terkenal dengan keindahan dan kealamian pantainya.</p><p><br />Masyarakat sering menyejajarkan keindahan pantai ini dengan pantai-pantai ternama di Pulau Bali, seperti Kuta, Legian, dan Sanur. Bahkan, keindahan Pantai Senggigi sering dilukiskan melebihi pantai-pantai tersebut, karena kondisinya yang jauh lebih nyaman dan tenang. Mungkin hal ini terkait dengan belum maraknya kedatangan turis mancanegara di pantai ini.</p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="http://3.bp.blogspot.com/_f3wJfyINpgY/TKmowVopy1I/AAAAAAAAABY/UubyEsgMoB8/s1600/senggigi-beach.jpg" alt="" width="380" height="256" /></p><p><br />Sebagai kawasan wisata pantai andalan Propinsi Nusa Tenggara Barat, Senggigi masih relatif alami dan terjaga kebersihannya. Pantainya yang masih asri, debur ombaknya yang tak terlalu besar, dan keindahan pemandangan bawah lautnya, semakin menegaskan bahwa pantai yang membentang sekitar 10 kilometer ini merupakan tempat idaman bagi para wisatawan domestik maupun mancanegara untuk melupakan sejenak rutinitas keseharian dan suasana hiruk-pikuk kota.</p><p><br />Pantai Senggigi kini mulai dilirik oleh para wisatawan, khususnya wisatawan mancanegara, karena daerahnya yang relatif perawan dan juga informasi yang telah meluas mengenai keberadaannya. Dengan bertambahnya minat dan antusiasme wisatawan ke Pantai Senggigi, pemerintah daerah setempat dan perusahaan sewasta makin giat membangun dan membenahi segala prasarana, agar para wisatawan makin tertarik untuk mengunjungi pantai ini.</p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="http://www.moreindonesia.com/wp-content/uploads/2010/03/The-Senggigi-Beach-One-Of-Orient-Beach-From-Lombok-2-510x340.jpg" alt="" width="380" height="253" /></p><p><br />Mengunjungi Senggigi di Pulau Lombok mungkin perlu dijadikan agenda wisata tersendiri bagi wisatawan yang menyukai keindahan dan kesejukan alam. Bayangkan saja, saat memasuki kawasan pantai, wisatawan dengan segera akan tersapu-lembut oleh semilir angin yang berhembus di sepanjang gugusan pantai di Lombok Barat, Propinsi Nusa Tenggara Barat ini. Suasana segar, nyaman, dan indah seolah menyapa wisatawan di awal kunjungannya. Saat telah berada di pinggir pantai, mata para wisatawan akan disuguhi oleh eksotisme pantai berlatar pesona ombak yang saling berkejaran, pasir putih yang menghampar, dan ribuan binatang kecil yang menyebar di hamparan pasirnya, serta lanskap Gunung Agung di pulau seberangnya (Pulau Bali).</p><p><br />Senggigi memang menawarkan pesona pantai yang khas. Suasana alami yang belum banyak dijejali oleh turis asing, seolah menjadi penanda beda pantai ini dengan pantai-pantai di Bali. Ini tentu memberi nuansa tersendiri bagi para pengunjung. Tak aneh, pantai ini kini dijadikan tujuan alternatif baru para wisatawan yang merindukan suasana kesenyapan alami yang menentramkan.<br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="http://4.bp.blogspot.com/-yo14BDKufIw/Tc8s8FeCm6I/AAAAAAAAADk/a_FPUZFALqc/s1600/lombok+%25281%2529.jpg" alt="" width="380" height="247" /></p><p><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="http://2.bp.blogspot.com/_vvPQM49A3zY/TB8BhGGkaRI/AAAAAAAAAI8/Ut_9yMrHWTY/s1600/sunset-lombok.jpg" alt="" width="380" height="286" /></p>', NULL, '37.jpg', 1),
(38, 'Phi Phi Islands Yang Sensasional', '2011-07-03 22:08:59', 'Di sebelah Selatan garis pantai Barat Krabi terletak Kepulauan Phi Phi yang keren, bagian dari Taman Laut Nasional Thailand itu menjadi salah satu tujuan yang gak akan lo lupain seumur hidup lo.', '<p><strong>Phi Phi Don</strong><br />Phi Phi Don, pulau yang lebih besar menawarkan tebing kapur terjal, pantai berpasir halus dan teluk yang tersembunyi. Gak jauh, taman coral dan karang dalam menjadi tempat yang sensasional buat nyelam dan snorkeling. Gak ada mobil di Phi Phi, yang hanya ada trek jalan kecil menyilang pulau, sehingga berkeliling di Phi Phi gampang banget, lo hanya perlu ngambil perahu ekor panjang (longtail) setempat, atau jalan kaki.<br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/1.jpg" alt="" width="380" height="285" /><br /><br />Phi Phi Don menawarkan beberapa pemandangan yang paling siap dibanding tempat manapun di dunia. PhiPhi Don sendiri terdiri dari dua bagian utama, secara khusus dihubungkan dengan bentangan sempit pasir putih yang berkilauan. Di bagian tengah, dilakukan pembangunan Ton Sai pertama. Sejak saat itu, Phi Phi Don mendapat reputasi sebagai salah satu lokasi pemandangan paling memikat di wilayah ini, yang menawarkan pemandangan pantai yang berkilau, pirus laut, dan landskap yang luar biasa. Reputasi ini, bagaimanapun, tidak datang tanpa harga yang besar.<br /><br /><strong>Phi Phi Leh (Phi Phi Ley)</strong><br />Phi Phi Leh yang lebih kecil tidak berpenghuni dan terdiri dari tebing-tebing kapur curam yang bermunculan dari pirus air. Phi Phi Leh juga memiliki gua-gua dan teluk-teluk kecil berbatu-batu. Ada beberapa teluk dangkal yang ideal untuk snorkeling, dan di sisi Timur Laut, terdapat Gua Viking yang terkenal, yang berisi apa yang diklaim sebagai lukisan prasejarah.<br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/2.jpg" alt="" width="380" height="281" /><br /><br />Phi Phi Leh juga menjadi lokasi yang populer untuk sarang burung wallet, sejenis burung layang-layang. Harganya bisa mencapai 2000$ per kilonya membuat penduduk berusaha mengumpulkan sarangnya untuk ngebuat sup sarang burung, yang buat orang China dipercaya memiliki nilai gizi tinggi banget. Tapi sekarang, kegiatan ini dilarang dan kini pengamanan khusus bahkan disiapkan untuk menjaga kawasan ini dari pemburu sarang burung.<br /><br />Perjalanan sehari ke Phi Phi tersedia dengan mudah dari Phuket dan Krabi dan biasanya menawarkan paket snorkeling di Phi Phi Leh. Kalo lo udah ada di Phi Phi Don, sangat disarankan untuk nyewa perahu lokal atau ikut tur untuk mengunjungi Phi Phi Leh. Tapi lo gak boleh bermalam di Phi Phi Leh.<br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/3.jpg" alt="" width="380" height="285" /><br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/4.jpg" alt="" width="380" height="247" /><br /><strong><br />Cuaca</strong><br />Musim Hujan : Mei &ndash; Oktober<br />Waktu terbaik untuk mengunjungi : November &ndash; April<br /><br /><strong>Suhu Laut</strong><br />Laut tetep anget pada suhu 29 derajat Celcius sepanjang tahun. Gak dingin untuk berenang, mendayung atau menyelam!<br /><br /><strong>Angin</strong><br />Dari 20 Oktober -15 April pulau-pulau Thailand ini didominasi oleh angin <br />Timur Laut yang kering. Ini berarti kondisi langit yang biru, udara kering dan malam berbintang.<br />15 Mei &ndash; 1 Oktober Phi Phi Island didominasi oleh angin lembab Barat Daya. Ini memberikan campuran antara hari cerah dengan<br />beberapa periode hujan basah.<br /><br /></p>', NULL, '38.jpg', 1),
(39, 'A Day with Red Racing Night', '2011-07-17 20:59:12', 'Satu hal yang bikin gue lega buat acara Marlboro Racing Night kemarin: yaitu semuanya bisa berjalan lancar dengan support dari temen-temen entourage yang gue undang kemaren ke acara Marlboro Vibe Racing Night.', '<p>Satu hal yang bikin gue lega buat acara Marlboro Racing Night kemarin: yaitu semuanya bisa berjalan lancar dengan support dari temen-temen entourage yang gue undang kemaren ke acara Marlboro Vibe Racing Night.<br /><br />Orang-orang yang gue undang adalah Garry Gunarsa, Annisa Sabrina, Dafi Afadila, Dyah sinta dan Eddu Enoary Eigven. Mereka adalah para young adult smokers dengan profesi sebagai desainer, baik art director di dunia periklanan (Gary dan Eddu), atau desain di bidang interior (Dafi dan Sinta).<br /><br />Be on time and enthusiasm. Mereka janjian tepat waktu dengan timing yang sudah dijanjikan dan ga rewel soal dress merah yang gue request. Malahan garry, salah satu guest yang gue undang, sempet menanyakan sebelumnya, "Kalau pake baju ini oke nggak?"<br /><br />Sampai di Blowfish berbarengan pukul 10.45 pm, kita masuk ke Blowfish dengan lolos cek id dan di foto bersama background Marlboro VIbes. Sempat ditawarkan Marlboro bundling pack oleh brand presenter, tapi kebanyakam dari mereka sudah pernah tahu tentang Marlboro bundling pack tersebut.<br /><br />Setelahnya saat masuk, mereka langsung memainkan trivia games. Kelima-limanya mengikuti trivia kuis tersebut, walaupun pada awalnya dafi, sinta dan bibin mengatakan nggak ngerti sama sekali tentang F1. Poin terbesar malahan didapatkan oleh Annisa Sabrina (bibin) yaitu 90 dibandingkan yang lain. (dan sst mereka menunggu pengunguman loh, meski ga menang :p)<br /><br />Gary dan Eddu terlihat yang paling antusias mengikuti games. Sinta dan eddu berhasil memainkan games dan mendapatkan topi.Eddu juga mendapatkan speaker dari games Catch the Ferari. Garry juga sempat mengikuti racing simulator di zona Ferrari tersebut.<br /><br />At least, they were interested with the games. Tapi ada beberapa komentar soal musik dan crowd-nya. To sum up, let''s see what they are saying:<br /><br />Garry Gunarsa: "Kemaren F1 feelnya berasa banget, bagus lah... Orangnya bisa berinteraksi dengan games...tapi musiknya biasa aja dhan... Apa gue yang ketuaan ya... :p . Tapi kalau gue perhatiin crowdnya seru abis, ampe ada yang jogednya serius banget gitu...hahaha"<br /><br />Annisa Sabrina: "Kemaren acaranya seru, tapi crowdnya ketuaan gitu yah? Banyakan cina ama bule. Trus musiknya asik, soalnya yg main dj Stan. Gamesnya seru, bisa balapan gitu di club..."<br /><br />Dyah Sinta: "Acaranya rame banget, seru juga dapet hadiah-hadiahnya. Sisanya standar tapi. Anyway, crowdnya seru dan lumayan asik..."<br /><br />Dafi Alfadila: "Pump up ghelllaaa... The crowd was excellent, the music&rsquo;s fine. Then the girls are pretty and crazy"<br /><br />Well, means they''ve got something by yesterday event. Hopefully, they will love to join the another day blash! thankyou Marlboro!<br /><br />Regards<br />Dhannisa Nurfira<br /><br />Brand ambassador Marlboro Jakarta</p>', NULL, '', 1),
(40, 'Linkin Park Returns To Singapore For Grand Prix Singapore 2011', '2011-07-17 21:08:33', 'Seolah-olah tidak cukup menawarkan hanya balap malam Formula 1, penyelenggara Singapura Grand Prix juga ngedatengin band yang memenangkan penghargaan multi-Band Linkin Park akan memimpin off-track hiburan tahun ini.', '<p>Seolah-olah tidak cukup menawarkan hanya balap malam Formula 1, penyelenggara Singapura Grand Prix juga ngedatengin band yang memenangkan penghargaan multi-Band Linkin Park akan memimpin off-track hiburan tahun ini. Jadi ga nyesel kalo kalian mau dateng :)<br /><br /><img src="http://www.gpnow.com/wp-content/uploads/2011/03/linkin_park1-460x250.jpg" alt="" width="460" height="250" /><br /><br />Pemenang Grammy Award Linkin Park telah menjual lebih dari 50 juta album di seluruh dunia sejak debut album mereka, Hybrid Theory, dirilis pada tahun 1996. Rilisan album mereka yang mungkin kalian udah pada punya, A Thousand Suns, sempat berada di puncak Billboard Top 200 album dan telah menghasilkan dua single hits. Linkin Park akan tampil pada hari perlombaan, 25 September, di Main Stage Padang (haha namanya mirip kota di Sumatra Barat ye).<br /><br />"Kami sudah mendapat respon yang sangat positif dalam perlombaan Grand Prix Singapore 2010 dan dengan bangga kami mengumumkan Linkin Park hanyalah awal dari bintang lainnya line-up artis untuk 2011," kata Michael Roche, direktur eksekutif, GP Singapura Pte Ltd. Intinya adalah kalo kalian datang ke Grand Prix Singapore kalian tidak hanya mendapatkan balapan F1 yang sangat unik karena diadakan di malam hari, tetapi juga sebuah nilai yang luar biasa dengan segala apa yang ditawarkan penyelenggara.<br /><br />So, siapa yang ga ngiler kalo dikasih ginian?</p>', NULL, '40.jpg', 1),
(41, 'Share Cerita Para SBA - Part 1', '2011-07-18 15:30:34', 'ini ada beberapa crita dari teman2 SBA Marlboro yang mungkin bisa jadi kenangan , pengalaman, semangat dan motivasi', '<p>Dear all,<br /><br />ini ada beberapa crita dari teman2 SBA Marlboro yang mungkin bisa jadi kenangan , pengalaman, semangat dan motivasi untuk yang lainnya. Barangkalai semua juga punya crita-crita, gw harap bisa saling share disini, untuk berbagi bersama...:)<br /><br />Catatan Erika - BA Jkt<br /><br /><br />SUKA DUKA PAS NYARI DATA<br /><br />Pas awal dpt ipad sih santai aja soalnya katanya blom aktif&hellip;.jdnya setiap ktmu org, tanya datanya aja dulu trus tulis dkertas,tisu,bb dll. Pas meeting di pp,katanya ipadnya udah bs dpake buat nyari data&hellip;.ya udah deh lgsg tester d org2 coffee bean pp, dengan semangat membara.<br /><br />Sebenernya yah, dimanapun kt berada cuek aja minta data&hellip;..mau sambil kerja, atau lain-lain. Paling enak kalo kerjaannya lg ngecrew2 acara,banyak org baru yg kenal&hellip;..yah pede aja lgsg mintain datanya :D. Dan yg paling enak kalo iseng ke kampus2,contoh Trisakti,PH dan Mustopo&hellip;..minimal banget tuh sekitar 20 org sih pasti kedata.<br /><br /><br />SERING DITOLAK ??<br /><br />Pasteeee&hellip;&hellip;,,yah tp itu kan resiko pekerjaan !TInggal cari lagi aja.Lagian ga smuanya nolak kok, gw sih yakin dlm 1 meja tongkrongan2,pasti 1 ato 2 orang mau ngasi datanya J<br /><br />PERNAH ISENG pas d area 51 pim 1.. Krn suka bgt sama FAHRI ALBAR ,gw cuek aja minta datanya,yg penting gw pnya foto ktp sama data2nya! Ampe skrg masih disimpeeeennnnnn.<br /><br />PERNAH NANGIS juga&hellip;&hellip;.,pas ipad blom dkasi kan gw udah nyari data lwt kertas,tisu,bbm,dll.. Smuanya gw simpen d notes bb skitar 30 an data! Karena gw buru2 ato salah mencet, ehhh smuanya kedelete :(((((. Hiks Hiks&hellip;.. Tp ya udahlah mau ga mau nyari lagiiiii.<br /><br /><br />KALO CARA BAGI WAKTUNYA<br /><br />&hellip;..sbnernya gw lbh lama wkt dluar rmh drpd drmh,soalnya gw kalo klamaan drmh bdn dll sakit smua alias ga betah! Gw tidur 2 ampe 3 jam itu uda cukup..makanya bdn gw gendut kayanya kbanyakan angin dll..hahahaha. Jadi pasti paling jelek gw sehari bisa nyari 5 data untuk akuisisi MM.<br /><br /><br />DIBANTU TEMEN<br /><br />Kadang tmn suka gatel bantuin,soalnya pd gemes sendiri kadang liat aku nyari data&hellip;&hellip;.pernah brp kali ga mood nanya org buat minta data,tp beruntungnya punya teman-teman, mrk pasti pd semangatin smuanya dan ikut bantuin nanya ato nulis! Lama klamaan moodnya dtg lg, gara2 liat tmn2 yg bukan BA malah lbh smangat.<br /><br />Trus kadang SUKA SEBEL sama org2 yg nanya datanya buat apa,udah djelasin panjang,komplit dan jelas eh ujung2nya mereka gak mau ngasi datanya..hadeeeehhh apa mau dkate sabar aja daahhhh.<br /><br />Oiya,pernah jg minta data pas lg ngelayat orang,dll..Abis lama klamaan gatel sndiri kalo liat ada org yg blom gw data.<br /><br />Pernah juga pas nyari data d gandaria city..saking hebohnya mereka skitar ber 5 mau isi data..pd rempong! Eh ipadnya nyaris jatoh..bikin pusing!<br /><br /><br />ENAKAN RAME-RAME<br /><br />Lbh enak kalo nyari data lg brg2 tmn BA yg laen..bisa ganti2 an pas awal buat ngomong sama org yg mau diminta datanya,trus tinggal bagi2 aja deh ntar datanya! Malah bikin makin smangat&hellip;.ga ada kata2 \\" mager \\" . Kalo gw lbh sering sama BA Petradan BA Kiki.<br /><br /><br />SUKA DUKA?<br /><br />Yaaahh sbnernya kbanyakan suka drpd duka..<br /><br />Sukanya jd tambah banyak tmn sama link2 kerjaan dll. Dukanya paling ditolak mentah2,nyimpen data ilang,sama ipad rusak,sama minta data k org yg ternyata uda dminta data sama BA laen :p<br /><br />Gitu deh sekilas crita-crita yang ingin dishare, dan gak mungkin gw lupakan.<br /><img style="border: 5px solid black; margin: 5px auto; vertical-align: middle; display: block;" src="contents/uploads/SBA%20part%201%20ori_2.jpg" alt="" width="380" height="285" /></p>', NULL, '41.jpg', 1),
(42, 'Catatan SBA Part 2 - \\"Kiat - Kiat Petra\\"', '2011-07-18 15:39:55', 'Ini secuil crita dari Petra SBA Jkt, yang lain boleh posting sendiri ya crita-crita dan jurus-jurus kalian dalam mencari akuisisi.', '<p>Ini secuil crita dari Petra SBA Jkt......Yang lain boleh posting sendiri ya crita-crita dan jurus-jurus kalian dalam mencari akuisisi.<br /><br />Jurus-jurus PETRA :<br /><br />1. TENTUKAN TARGET :<br />yah kalau gw sendiri pas diterima jd BA , udh mulai nulis di notes bahwa 1 bulan kedepan gw akan ngedata dimana aja yg menurut gw untuk 1x gw ke tempat itu gw akan mendapat antara 20-30 data,seperti ke tongkrongan universitas2,dan komuniti2 yg ada di Jkt.dan Ada juga yg tiap kali gw mau jalan2,ngumpul sama temen2 di mall/tempat nongkrong lainnya yah gw udh mempunyai target kalau setiap 1 hari gw jalan2 gw bisa dapat min 5-10 data...klo gw kurang dari target yg udh gw tetapin gw pasti sebelum sampai rumah gw mampir di circle k/711/mcd deket rumah gw untuk mendapat data untuk target harian gw itu.<br /><br />2. KEJAR TARGET:<br />Kalau untuk kejar target seperti misalnya tinggal 1minggu dari batas waktu bulanan sudah selesai tp data gw msh kurang sekitar 70an data&hellip; yah jujur aja keteteran. Tetapi solusi dr gw yah 1 minggu=7hari x 12 sampai 15 data ? pasti selesai kok =)<br /><br />3. ATUR WAKTU :<br />hmmmm klo waktu nih mungkin krn gw udh lulus kuliah dan belum ada pekerjaan yg tetap jd masih nyantai yah..mau ke tempat yg udh gw targetin kapan aja bisa&hellip;..tp biasanya waktu gw untuk mencari data itu dimulai dr jam 12 siang kadang2 sampai sore. Dan klo emang mau lanjut jalan2 yah bisa sampai tengah malem ,kadang2 juga keluarnya maghrib biar langsung lanjut jalan2 dan ngumpul2 sm temen&hellip;.yah sambil menyelam minum air lah heheheh =)<br /><br />4. MANFAATKAN TEMAN DAN KOL<br />Yang gw lakuin untuk orang yang baru kenal yah sejujurnya enakan kerja tim ,krn kebetulan dr awal keterima BA ini gw berteman baik dgn beberapa BA yg sama dan saling membantu membagi tugas misalkan kita ke suatu tempat,jadi udah ditetapin gw bagian sana,lo bagian sana,dan dia bagian sana,otomatis kalo semua serentak bergerak. Temen2nya pd nanya \\''eh itu ada apa sih?\\'', otomatis mereka penasaran dan lebih gampang untuk mengajak temen2 mereka yg lain untuk isi MM itu,tp klo gw kerja sendiri (tanpa tim) yah harus percaya diri aja yah dan punya keberanian buat bertemu dengan org baru (sampe kadang2 suka sok asik dan akirnya kenalan juga dapet temen baru).<br /><br />Sampai sejauh ini gw lumayan dibantu sm KOL gw, jd klo lg jalan sm dia,misalkan dia ketemu temennya pasti langsung disodorin suruh isi iPad gw&hellip;.hehehe tp klo orang yg udah kenal sih itu sangat2 gampang...Dan titip pesen aja klo ada temen lo yg kesini lagi nanti gw samperin lagi malahan kadang2 suka dibawa ke resto/tempat lain yg ada temen2nya ngumpul.<br /><br />5. PENGALAMAN SUKAnya<br />Yang pasti gw dapet temen baru yg pernah gw data dr semua kalangan dan temen2 BA,BC,PMI dan menambah pengalaman di dunia kerja,persaingan,hiburan.Pergaulan dan pengetahuan gw juga jadi lebih luas. Dan menurut gw ini kerjaan yah sesuai rutinitas dan hobi gw yg suka jalan2,ketemu sm orang &hellip;.yah semua numpuk jadi satu.<br /><br />Jujur gw sendiri bangga kepilih jd Brand Ambassador Marlboro sampe suka digangguin sm temen2 gw si Miss Marlboro&hellip;..heheehehe<br /><br />6. PENGALAMAN DUKAnya<br />&hellip;&hellip;hmmmm gw beberapa kali mau minta data ke orang tp ditolak =(<br /><br />Ada yg takut disalahgunain, curiga,dll.<br /><br />Sebel dan kesel sih tp ya udalah yah. Dan mungkin suka dikira orang2 sombong kali yah kemana2 &ldquo;ngapain nih orang nenteng2 iPad?&rdquo;, karena iPad ky udh jd barang keseharian yg klo kemana-mana tiap kali bergerak ingetnya iPad (bulan bb sama dompet lagi sekarang) hehehehe.<br /><br />Dan mungkin sering banget klo gw lg ngedata di beberapa tempat ,gw suka ditanyain \\"kalau gw isi data di iPad lo gw dapet apa\\" (sering banget mereka minta kyk souvenir dr Marlboro &ndash; mungkin ini bisa jadi insight dari gw untuk pihak Marlboro,hehe)<br /><br />Tapi ya sudahlah semua pekerjaan kan ada suka dan dukanya ,yah semua ini jadikan pengalaman dan pelajaran hidup...<br /><br /><br />*Petra &ndash; BA Jkt *<br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/SBA%20Part%202%20Ori.jpg" alt="" width="380" height="285" /></p>', NULL, '42.jpg', 1),
(43, 'SBA Story Part 3 - Gigihnya Seorang WINNIE', '2011-07-18 16:05:55', 'Ini cerita tentang dibalik layar mencari akuisisi dari seorang Winnie. Winnie adalah salah satu BA yang gw salut dan angkat topi', '<p>Guys and Girls,<br /><br />Ini cerita tentang dibalik layar mencari akuisisi dari seorang Winnie. Winnie adalah salah satu BA yang gw salut dan angkat topi (gw sebut salah satu, karena banyak dari BA-BA lainnya yang gw favoritkan dan yang juga gw angkat topi untuknya). Winnie (seperti BA lainnya) yang masih muda, energik,cerdas, dan kritis (ehemm...) kalau gw liat dari critanya, sangat punya semangat yang positif dan optimi, dan profesional. Semoga utu bisa dibuktikan terus ke depannya. Dan banyak hal yang gw dapat belajar dari dia. Semoga ke depannya Winnie bisa terus menampilkan potensinya secara maksimal. SIlahkan disimak, dan kita ambil positifnya.<br /><br />Cheers,<br /><br />Yuke<br /><br />AKUISISI STORY by WINNIE - BA Jakarta<br /><br />Menjadi seorang brand ambassador dari produk rokok terbesar di Indonesia; yakni Marlboro, sudah pasti menjadi perkerjaan yang menantang. Gw di kasih target untuk mencari 100++ registrant setiap bulannya dan gw selalu berusaha untuk memenuhi target itu, bahkan gw berusaha untuk melebihi target. Kenapa? I paid professionally and of course I do my job professionally. Jadi di kamus hidup gw ga ada tuh alasan gara-gara sibuk skripsi, kerjaan lain, atau main gw jadi ga bisa menuhin target. Sejak gw tanda tangan kontrak gw sudah tau apa yang menjadi kewajiban gw. Hey nothing easy if wanna make ur life better. Kerja keras itu kuncinya. Apalagi Philip Morris dan Brightcomm udah bekerjasama secara kekeluargaan dan dekat dengan para Brand ambassador. Masa air susu mau dibales air tuba? :p Inilah yang jadi patokan gw buat ngejar target-target akuisisi dan engagement.<br /><br />Gw mulai mencari registrant dari lingkungan kampus gue. Kampus gue yang notabene fakultas sastra yang dimana-mana orang-orangnya hamper pada ngerokok semua jadi pasar potensial buat ngeraih target. Selama musim perkuliahan gw sering banget nongrong dikampus dr pagi sampe sore buat minta-mintain data registrant. Dari yang selama ini ga kenal tp sering liat, jadi kenal gara-gara nekat gw maintain data pas dial lg asik ngerokok. Sampe orang yang baru gw liat nongkrong di kantin tetep gw samperin buat ngisi data di ipad. Sampe-sampe setiap gw masuk kantin, anak&rdquo; slalu nanyain gue &ldquo;udah kekejar 1000 orang belom win?&rdquo; atau celetukan usil kayak &ldquo;mbak-mbak ipad&rdquo; atau &ldquo;mbak-mbak Marlboro&rdquo;. Tapi semuanya gw jadiin bahan bcandaan aja, karena emang budaya kampus gw yg suka ngeledek satu sama lain. Lagipula yang suka ngeledekin gw itu sering banget bantuin gw buat nyari data dengan ngenalin gw ke temen-temennya yang belom ngisi data.<br /><br />Weekend juga gw manfaatin buat meraih data. Tempat-tempat kayak 711 jd pasar gw &ldquo;menjaring ikan dilaut&rdquo; dimana perokok ngumpul semua disitu dan orang-orang yang ada disitu come and go, alias perputaran orang yang dating kesitu bergulir dengan cepat. Ditemenin kawan, gw mulai bergerilya buat nodong mereka isi data. Dari yang sok asik aja, sampe lama&rdquo; keder sendiri karena 1 meja rame banget. Tapi tetep gw bantai karena mereka potensial dengan image Marlboro yang identik dengan anak muda.<br /><br />Cerita lucu ya banyak lah. Namanya juga gw ketemu sama banyak orang, karakteristik mereka juga beda-beda. Ada yang &ldquo;kepo&rdquo; gila nanyain : &ldquo;ini buat apa sih win?&rdquo; &ldquo;gw kalo ngisi dapet hadiah rokok dong&rdquo; sampe ada yang ngomel-ngomel karena data yang harus diisi itu berhalaman-halaman. Semua gw tanggepin dengan serius, sampe bercandaan asal. Tergantung karakter orangnya aja :D. kalo cerita sedihnya yang paling utama mewarnai sih, orang yang mau gw maintain data udah ngisi duluan sama BA lain. Lumayan deh tuh ngerasa kalah cepet. Hehehe.. namanya juga bagi rata. Ya udah deh cari yang lain lagi.<br /><br />Sejauh ini cerita diatas ngerangkum aktivitas gw dalam mencari data. Mudah-mudahan (dan harus) kedepannya pencarian registrant dan engagement berjalan dengan lancar yaa.<br /><img style="border: 5px solid black; margin: 5px auto; vertical-align: middle; display: block;" src="contents/uploads/SBA%20Part%203%20Ori.jpg" alt="" width="380" height="285" /></p>', NULL, '43.jpg', 1);
