(44, 'Goodbye Awkward ', '2011-07-25 19:15:23', 'Satu hal tertanam di benak gue ketika akan melakukan engagement dengan 4 orang entourages yang kebanyakan dari mereka belum saling kenal, yaitu awkward moment.', '<p style="text-align: left;"><strong>The Art of Engagement with The Art Lover</strong><br /><em></em><br /><br />Satu hal tertanam di benak gue ketika akan melakukan <em>engagement</em> dengan 4 orang<em> entourages</em> yang kebanyakan dari mereka belum saling kenal, yaitu awkward moment. Hal yang pasti terjadi ketika kita berada di antara orang-orang yang belum kenal sebelumnya. Tapi itulah yang menarik. Lebih lagi, Gue sengaja mengajak ke tempat yang bukan <em>party oriented.</em> <em>Well, I think for this time will be nice</em> kalau kita bisa mingle lebih dalam dalam keadaan sober :p.<br /><br />Janjian jam 9 malam, para <em>entourages</em> gue pun berkumpul satu demi satu. <em>Entourage</em> gue adalah <strong>Angie</strong> dari Inch of Mesa dan Binusian, <strong>Ricardo Suwandy</strong> pemilik &ldquo;Vote For Nothing&rdquo; clothing line dengan Rayi RAN dari MU Indonesia, <strong>Garry Gunarsa</strong> seorang Art director BBDO Indonesia, dan <strong>Wastuwidyawan</strong> dari Liason. Mereka kebanyakan memiliki minat yang sama yaitu <strong><em>Art and fashion (especially).</em></strong> <em><strong>Well, they&rsquo;re designer and conceptor- culture Vulture- not only as art connossieur.</strong></em><br /><br />Kebanyakan hari itu yang datang adalah para anggota komunitas<strong> Liason.</strong> Bercerita sedikit tentang Liason, Liason adalah komunitas seni dengan urban art oriented yang terdiri dari 10 orang. Mereka adalah para dedengkot lulusan ITB seni rupa- tetapi sekarang kebanyakan dari mereka berdomisili di Jakarta dan seringkali melakukan pameran di Jakarta. <br /><br /><img style="border: 5px solid black; margin-top: 5px; margin-bottom: 5px; vertical-align: middle;" src="contents/uploads/The%20Liason%20-%20Art_5.png" alt="" width="380" height="285" /></p><p style="text-align: justify;"><strong><em>Salah satu karya anggota Liason dalam pameran The Weekend Project</em></strong><br /><br /><br />Awalnya gue sama sekali nggak mengenal mereka, tetapi karena sangat tertarik dengan latar belakang Liason,berkat bantuan temen Gue... Gue pun nekat ngajak mereka ketemuan dan ngobrol-ngobrol. <br /><br />Balik ke soal engagement- awalnya memang berasa awkward banget dengan keadaan kita nggak saling kenal. Memilih meja di bagian belakang yang jauh dari hingar bingar musik dan keramaian- membuat kita pada awalnya bingung membuka topik. Tapi ternyata itu hanya bertahan di menit-menit awal, karena pada akhirnya kita membaur satu sama lain dan ngobrol banyak hal. <br /><br /><strong>Sharing stories and Ideas.</strong><br /><br />Dengan menikmati <em>beer pitcher</em> bersama-sama, kami <strong>bersebelas</strong>.. membicarakan tentang pekerjaan masing-masing, Mulai dari <strong>Renassya</strong> seorang Desainer Interior yang pernah mengerjakan <em>project interior</em> untuk Ice-skating Mal Taman Anggrek;<strong> Garry</strong> &ndash; Art director BBDO, yang telah mengerjakan banyak desain iklan untuk Flexi-<strong> Angie</strong> yang sedang gencar mengikuti seminar mengenai fashion bussines- Wastu dengan lukisan dan pamerannya. (Kebanyakan dari mereka ingin melanjutkan ke jenjang S2 ! <em>Applause</em>...:).<br /><br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/Dhannisa%20-%20engagament%20%282%29_2.jpg" alt="" width="380" height="315" /><br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/Gak%20butuh%20waktu%20banyak%20untuk%20mencairkan%20suasana%20-%201_5.jpg" alt="" width="380" height="329" /><br /><strong><em>Nggak butuh waktu banyak untuk mencairkan suasana!</em></strong><br /><br />Kita juga ngobrol banyak soal hubungan rokok dan kreativitas-seni dan pekerjaan. Ngomongin soal logo dan Jingle Marlboro. Seru. Gue bisa dapetin<strong><em> insight-insight</em></strong> yang menarik dari persepsi mereka. Gimana mereka gambarin tentang rokok menurut mereka. Gambaran-gambaran seru tentang acara-acara yang menurut mereka inspiratif. <br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/me%20taking%20picture%20with%20liason%20-%203_3.jpg" alt="" width="380" height="256" /><br /><strong><em>Me taking a picture with Liason</em></strong><br /><br />Gue juga dapet kesempatan akuisisi dua sampai tiga orang yang belum pernah gue akusisi. Mereka serius banget main Miss Match. Nggak mau sampe dapet <strong>Rare Fruit</strong> dan pengen banget dapet <strong>Brother in Arts.</strong> <br />To sum up, mereka seneng banget bisa ngumpul dan dikenalin bareng sama orang baru secara tiba-tiba. Punya pandangan baru dan tentunya... <strong><em>see ya later guys and thanks for much ideas and insights!</em></strong> <br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/me%20and%20all%20the%20participant%20og%20engagement%20-%204_3.jpg" alt="" width="380" height="256" /><br /><strong><em>Me and all the participants of engagement</em></strong><br /><br /><br />Regards<br /><br />And keep up the good work!<br /><br /><strong>Dhannisa Nurfira</strong><br /><strong>Brand Ambassador Marlboro Jakarta</strong><br /><br /><br /><br /><br /></p>', NULL, '44.jpg', 1),
(45, 'Oh My Love, It\\''s Zouk Out', '2011-08-05 08:35:08', 'Kalau loe ngaku partygoers sejati,  coba tengok Zouk Out, Singapore, dan segala keriuhan party-nya. Its super heboooh!', '<p><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/H9ugloyipdlmn45.jpg" alt="" width="320" height="213" /><br /><br />Kalau loe ngaku partygoers sejati, coba tengok Zouk Out, Singapore, dan segala keriuhan party-nya. It&rsquo;s super heboooh!<br /><br />Dari awal tahun 2000, Zouk Out telah menjadi the ultimate beach dance party yang kebanyakan pecinta musik dari seluruh wilayah berharap buat datang di setiap tahunnya. Eventnya sendiri berlangsung selama 12 jam non stop!!! Konsep eventnya juga selalu mengusung konsep-konsep party yang groundbreaking, futuristic, unique and organic. Zouk Out juga tetap tak tertandingi dalam hal line-up DJ dan musiknya, dan kemampuannya untuk membuat kehebohan senja sampai fajar keesokan harinya. David Guetta, Tiesto, Ghetto, Dubfire, Afrojack, dan banyak banget line-up yang pernah ngisi Zouk Out.<br /><span class="Apple-style-span" style="white-space: pre;"><br />So people, berani kasih ide buat event Marlboro ala Zouk Out ?<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Aslys5vtmbahiel.jpg" alt="" width="320" height="214" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/F3j6ozg2vv6b1ev.jpg" alt="" width="320" height="214" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Adhoozft3ifd5h1.jpg" alt="" width="320" height="214" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Llauuweynlscrb4.jpg" alt="" width="320" height="214" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Dbfl1pomifr5bkq.jpg" alt="" width="320" height="214" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Hs4kte188wxxymm.JPG" alt="" width="320" height="214" /></span></p>', NULL, '45.jpg', 1),
(46, 'Pakai Strategi ala Agen Asuransi', '2011-08-09 07:59:03', 'Oke dari yang pertama, untuk target engagementnya, aku bikin daftar aja kayak jadi agen asuransi hehehe. Awalnya sih nulis daftar nama yang aku kenal, cari dari jejaring sosial trus mulai nulisin nama dan no telpnya.', '<p><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/Stevefanus%20Dwijaya%20Gunawan%20P.%20-%20Surabaya.JPG" alt="" width="320" height="482" /><br /><br />Hm bingung mau sharing yang mana dulu nih.<br /><br />Oke dari yang pertama, untuk target engagementnya, aku bikin daftar aja kayak jadi agen asuransi hehehe. Awalnya sih nulis daftar nama yang aku kenal, cari dari jejaring sosial trus mulai nulisin nama dan no telpnya. Trus tinggal aku telponin satu satu bikin janji buat ajakin jalan. Tapi yang paling penting sih ngingetin temen yang aku telpon buat ngajakin temen temennya yang lain. Alesannya sih biar makin banyak temen dan sebagainya,persis kaya agen asuransi sih tapi tekniknya lumayan buat nambah temen baru plus registran.<br /><br />Kalo masalah bagi waktu sih sebenernya emang cukup kewalahan tapi mau gimana lagi kan harus dibawa nyantai aja. Pokoknya aku luangin aja satu hari 2-3jam buat hangout sama temen temen.<br /><br />Terus kalo ngomongin suka dukanya, sukanya yah ketemu temen baru, punya wawasan baru, sama pergaulan baru. Kalo dukanya sih kalo temen temen yang aku ajakin jalan pada ga nyambung omongannya, itu ga enak banget. Oh iya, sama kalo ada temen yang sok jual mahal atau sombong. Wah nyebelin banget kalo nemu yang kayak gitu. Sama duitnya nih kak jebol terus gara gara tiap hari nongkrong mulu hehehe. Kalo pas lagi buntu ga ada yang diajak bingung deh apalagi kalo target ga kekejar wah pusing ngejar targetnya, kan sehari minimal musti ngajakin 5 temen baru paling engga.<br /><br />Yah semoga event2 yg mau dibikin bisa berhasil soalnya sebenernya aku juga agak bingung kita udah disuruh bikin target , ide event ,sama engagement plannya. Yahh semoga semuanya berjalan seperti yang kita rencanakan, soalnya selama 3 bulan ini keadaan tidak sesuai seperti yang dibayangkan pas workshop/training di Jkt. Ternyata banyak tantangan euuyyy di lapangan.... MAJU TERUS PANTANG MUNDURRRR..... :D<br /><br />Untuk sementara ini dulu deh kayaknya. Maap kalo penataan tulisannya agak kacau wkwkwk. Kalo ada yang salah atau menyinggung jangan dimakan ati yah kak, cukup minum teh botol aja (peace). Nuwun sewu, minta maap.<br /><br />Thanks.<br /><br />Regrets.<br /><br />Steve.</p>', NULL, '46.jpg', 1),
(47, 'Mengenal Sirkuit Marina Bay', '2011-08-11 10:39:26', 'Marina Bay Street Circuit adalah sirkuit jalanan di seluruh negara kota Marina Bay dan merupakan tempat untuk Singapura Grand Prix dengan panjang 5,073 km (3,15 mil).', '<p style="text-align: justify;">Nah sekarang kita ngebahas sirkuit Marina Bay kayaknya seru juga nih. Marina Bay Street Circuit (atau dikenal sebagai GP Singapura Street Circuit) adalah sirkuit jalanan di seluruh negara kota Marina Bay dan merupakan tempat untuk Singapura Grand Prix dengan panjang 5,073 km (3,15 mil).<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/260px-Singapore_street_circuit_v2.svg.png" alt="" width="320" height="210" /><br /><span class="Apple-style-span" style="white-space: pre;">Sirkuit ini dirancang oleh KBR, Inc, merupakan modifikasi dari yang asli<br />pertama kali diusulkan oleh Hermann Tilke.</span> <span class="Apple-style-span" style="white-space: pre;">Pada hari konfirmasi dari Singa<br />pore Grand Prix pada musim 2008 Formula Satu.<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/800px-Singapore_grand_prix_fullerton_test.JPG" alt="" width="320" height="180" /><br /><br />Daerah pit dari sirkuit ini terletak di plot tanah kosong dari Republik Bou<br />levard dan di samping Singapore Flyer.<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/800px-Singapore_grand_prix_day_z.JPG" alt="" width="320" height="180" /><br /><br />Tapi anehnya sirkuit ini ini secara luas dikritik oleh driver F1 karena terlalu<br />bergelombang, sehingga sangat tak kenal ampun si sirkuit, terutama meng<br />ingat kondisi panas dan lembab dari iklim Singapura.<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/800px-RafflesAvenue.JPG" alt="" width="320" height="240" /><br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/800px-1_-_F1_Stand_Area_2.JPG" alt="" width="320" height="240" /><br /><br />Seorang pembalap dunia Lewis Hamilton berkomentar bahwa Marina Bay<br />itu dua kali lebih keras untuk dijinakkan daripada sirkuit Monako yang lebih<br />terkenal. Unbelievable. Membutuhkan dua kali lipat jumlah energi selama putaran<br />tunggal dibandingkan dengan sirkuit Monako. Awesome.<br /></span></p>', NULL, '47.jpg', 1),
(48, 'Ngabuburit Bareng Surabaya Heritage Track', '2011-08-22 09:04:08', 'Buat kalian Brand Ambassador Surabaya kayaknya seru tuh ngabuburit ngajakin temen temen lo atau keluarga lo buat ngabuburit di House of Sampoerna.', '<p><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/1608118620X310_2.jpg" alt="" width="320" height="165" /><br /><br /><br />Buat kalian Brand Ambassador Surabaya kayaknya seru tuh ngabuburit ngajakin temen temen lo atau keluarga lo buat ngabuburit di House of Sampoerna. Kebetulan, Surabaya Heritage Track (SHT) yang dikelola oleh museum House of Sampoerna mengadakan &ldquo;Ngabuburit Track&rdquo; yang berlangsung pada 2-28 Agustus 2011.<br /><br />Kalian akan naik bus merah, lengkap dengan pemandu, kalian akan diajak tur keliling ke masjid-masjid yang ada di Surabaya. Jadi lo dapat kesempatan untuk mengenal dan juga melihat dari dekat keunikan arsitektur bangunan masjid dan tentu saja sejarah di baliknya.<br /><br />Pada tahun ini, salah satu tempat yang harus kalian kunjungi pas ikutan tur adalah Masjid Muhammad Cheng Hoo yang memiliki arsitektur unik dengan nuansa Tionghoa. Masjid dengan rancangan awalnya diilhami dari bentuk masjid Niu Jie di Beijing yang dibangun pada tahun 996 M ini memiliki filosofi pada setiap bagian dari bangunannya. Gak cuman penjelasan tentang filosofi bangunan, kalian juga akan mendengarkan tentang sejarah Laksamana Cheng Hoo. Cool right?<br /><br />Nah kalian juga akan diajak untuk mengunjungi Masjid Kemayoran, salah satu masjid tertua di Surabaya. Beberapa versi sejarah awal berdirinya bangunan ini bisa ditemukan di berbagai sumber. Asal muasal nama unik masjid ini pun akan dijelaskan pada kunjungan ini.<br /><br />Tur tematik SHT diselenggarakan buat masyarakat Surabaya guna memperkenalkan potensi-potensi wisata Surabaya yang tersebar di berbagai sudut kota yang terkenal sebagai Kota Pahlawan.&nbsp;Tur SHT dapat dinikmati oleh wisatawan maupun masyarakat Surabaya secara gratis.&nbsp;Jadwal tur pada hari Selasa sampai Minggu di pukul 15.00-16.30 WIB.</p>', NULL, '48.jpg', 1),
(49, 'Sychedelic in Psychedelic Party', '2011-09-19 10:02:06', 'Nggak berasa udah seminggu lewat acara Euphoria Sychedelic berlangsung. Tapi sampe sekarang, euphoria tersebut masih terasa. ', '<p style="text-align: justify;"><strong>Hello mates!</strong><br /><br />Nggak berasa udah seminggu lewat acara <strong>Euphoria Sychedelic</strong> berlangsung. Tapi sampe sekarang, euphoria tersebut masih terasa. Semoga belum telat untuk memposting sedikit tentang acara <strong>Euphoria Sychedelic</strong> yang diadakan di Marley Jakarta, 10 September kemarin. Bukan cuma bagaimana acara berlangsung, tetapi juga tentang suka duka mengadakan acara <strong>Euphoria Sychedelic</strong> . <em>Then, I know u don&rsquo;t need opening anymore&hellip;</em><br /><br /><em><strong>The more many people come, the more challenges that exist&hellip;</strong></em><br /><br />Secara waktu dan kuantitas , Brand Ambassador Jakarta memiliki lebih banyak kesempatan dalam mempersiapkan acara untuk <strong>PL Engagement</strong>. Dengan bermodalkan 16 Brand Ambassador dan waktu yang lebih banyak, kami pun mencoba membuat sebuah <em>benchmark</em> bahwa kita harus memberikan yang terbaik. Faktanya, bukan hal yang gampang menyatukan 16 Brand Ambassador yang punya rangkaian kesibukan mulai dari kerjaan yang numpuk, skripsi yang ada di depan mata, ngurusin pacar yang mungkin mulai manyun karena waktu nge-date berkurang hingga mudik yang sulit ditolak.<em> Well</em>, sebagai tim banyak hal yang kami lalui baik sifatnya internal maupun eksternal kadang terasa sulit hingga ingin rasanya membenarkan pernyataan &ldquo;Jakarta Keras Man&rdquo;. <em>However, from those difficulties and challenges, we tried the boss of best</em>. Dari bikin Video Teaser, Syuting Video Brand Ambassador, Persiapan sampe sedetailmungkim, hingga sampailah kami disebuah penghujung penantian hari H- yang kami sebut <strong>Euphoria Sychedelic</strong>&hellip;<br /><br /><em><strong>Over capacity!</strong></em><br /><br />Lumayan kaget, karena ternyata pengunjung yang dateng <em>full</em> melebihi kapasitas Marley. Mulai dari kurang lebih jam 9 malam sudah mulai berdatangan para undangan baik dari <em>entourage</em> maupun dari<em> public invitation</em>.<em> Suprisingly</em>, hingga jam 12 malam ada <strong>286</strong> pengunjung! <strong>70</strong> diantaranya adalah <em>entourage</em> yang diundang secara khusus dan beberapa dari pihak PMI dan BC yang tak mau kalah berdandan Sychedelic. <em>Well, over capacity can be something good; vice versa</em>. <em>In fact</em>, kita sebagai panitia sempat kelimpungan, sempet panik karena dampak <em>over capacity</em> tersebut. Di sisi lain, karakter para <em>enotourage</em> kita yang cukup malu-malu membuat acara pada awalnya terasa canggung. Namun, semakin malam pun semakin banyak orang yang datang &ndash; lalu semakin sempit, barulah mereka bisa <em>mingle</em> satu sama lain. So, orang Jakarta suka yang sempit-sempit kali ya? :P <br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/Picture1.jpg" alt="" width="320" height="214" /><br /><br />Di acara Euphoria Sychedelic, kami mengajak para entourage kami untuk berpartisipasi mengisi acara. BA perform (Jules, Frizz, Aldo, Rompas), <strong>Riversally, Fly After, Parisude, Appplonia, Dj Monty, Dj Dhika, Fashion Show Inch of Mesa feat Identity, Visual Instalation 20/20 Sight Scenery dan pemutaran video perkenalan Brand Ambassador Jakarta</strong> adalah serangkaian acara yang menjadikan Euphoria Sychedelic menjadi hidup. Tak lupa untuk undangan special kami <em>which is entourage</em> kami, mereka harus foto terlebih dahulu di Sychedelic Shoot!<br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/Picture2_1.jpg" alt="" width="320" height="212" /><br /><strong>Who got the best pose in Sychedelic Shoot?</strong><br /><br /><em>We also give appreciate for </em><strong>Best dress male and female</strong>, <em>the winner are</em> Galih, Citta dan Mas Fathur dari BC. <em>We hope, the event will get the place in the participants&rsquo; memory</em>, meskipun kita akui masih banyak kekurangannya. <em>At least, we&rsquo;ve learned many things from this from those experiences.</em> <br /><br /><strong>Thanks to Marlboro, PMI and BC; thanks for your trust and support!</strong><br /><br /><strong>And of course for the BA Jakarta team. You guys rock!</strong><br /><br /><img style="border: 5px solid black; margin: 5px; vertical-align: middle;" src="contents/uploads/Picture3.jpg" alt="" width="320" height="244" /><br /><strong>DJ Monty with Visual Instalation by 20/20 Sight Scenery</strong><br /><br /><br /><strong>Dhannisa Nurfira</strong><br /><strong><em>Proudly being the part of Brand Ambassador Marlboro Jakarta</em></strong><br /><br /></p>', NULL, '49.jpg', 1),
(50, 'Innerlight', '2011-09-23 10:35:37', 'Lo semua pernah dengar dong yang namanya Innerlight? DJ yang namanya saat ini sedang berkibar kencang di crowd clubbing, nggak cuman di Jakarta. Wajar, namanya besar di Jogja.', '<p>Lo semua pernah dengar dong yang namanya Innerlight? DJ yang namanya saat ini sedang berkibar kencang di <em>crowd clubbing</em>, nggak cuman di Jakarta. Wajar, namanya besar malah di daerah: Jogja khususnya.<br /><br />Melihat orangnya, memang kesannya kalem dan sederhana. Tapi jangan salah, kesan itu bakal seketika pudar saat lo mulai mendengar racikan musik <em>trance</em> yang disuguhkan oleh pemilik album <em>Take Me To The Blue Blue Sky</em> ini. Musik menghentak, gebrakan-gebrakan suara bass dibalut nada-nada <em>trance</em> langsung menghidupkan suasana club.<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/inner.jpg" alt="" width="320" height="213" /><br /><br />DJ yang pernah mengenyam bangku kuliah di Fakultas Sastra UGM Yogyakarta ini, begitu cekatan memindahkan tangannya dari CD decks ke turntable lalu ke mixer dan perangkat peralatan lainnya.<br /><br />DJ Innerlight ini juga pernah menjadi arranger, pencipta, sekaligus programer pada album Syaharani <em>Magma; </em>dan kerap memainkan lagu dari albumnya sendiri, sembari di-<em>mix</em> dengan lagu-lagu lain yang dikuasainya. Selebihnya, entertainer yang mempunyai nama asli Eddie Triana itu lebih banyak memainkan sekaligus mengenalkan musiknya. Penampilan DJ Innerlight biasanya berhasil memaku <em>crowd</em> hinga benar-benar usai. Ia dapat memaksa pengunjung bergoyang lewat musik trance yang tergolong berat dan bahkan baru diperdengarkan.<br /><br /><img style="vertical-align: middle; border-width: 5px; border-color: black; border-style: solid; margin: 5px;" src="contents/uploads/inners.jpg" alt="" width="320" height="444" />&nbsp;</p>', NULL, '50.jpg', 1),
(51, 'ITS TIME FOR BOOSTER!', '2011-09-28 19:59:29', 'Tanggal 23-25 september kemarin adalah kali kedua seluruh SBA hadir buat melakukan performance booster. Kali ini training dilaksanakan di markas besar MFCI Senopati, yang telah disulap...', '<p>Tanggal 23-25 september kemarin adalah kali kedua seluruh SBA hadir buat melakukan performance booster. Kali ini training dilaksanakan di markas besar MFCI Senopati, yang telah disulap menjadi tempat yang cozy banget. Sebelum acara dimulai, para SBA langsung temu kangen. Bayangin bok, 6 bulan gak ketemu! Sekalinya ketemu dil uar kendali semua kan yaa&hellip; heboh foto-foto &amp; ngobrol-ngobrol untuk menuntaskan rindu yang sudah menggunung langsung jadi kegiatan yang wajib dilakukan tentunya :D<br /><br />Acara training dimulai sekitar jam 2. Rundown acara berjalan sangat menyenangkan dengan materi yang dikemas secara menarik dan membangun. Bukan Marlboro namanya kalo ngga ngasih surprise yang keren. Terbukti kita banyak mendapat surprise di hari pertama ini! Mulai dari campaign terbaru dari Marlboro, yaitu Marlboro Lights Connections yang hadiahnya priceless banget yaitu pemenang berhak mendapat vacation 10 hari ke Berlin-Istanbul-NYC, sampai dengan penggantian Ipad 2 yang bikin para SBA girang banget. That was a fun day&hellip;. <br /><br />Good day sunshine! Hari kedua adalah hari yang paling seru buat gw. Kita gak lagi di training di dalam ruangan. Ya! Di hari kedua ini, semua SBA dibagi per-tim sesuai dengan para Project Leader masing-masing dalam konsep Amazing Race. Kita dibawa berkeliling Jakarta untuk mendapatkan badges yang telah disebar di 6 titik Jakarta selatan. Di titik-titik tersebut, kita melakukan knowledge sharing dan membuat konsep segila mungkin yang nantinya akan dijadikan penilaian tim. <br /><br />Malam harinya kita semua diajak ke Blowfish untuk acara closing party performance booster. Again and again, Marlboro gives super-duper-mega-radical-unexpected surprise! Hadiah berupa PS3, Headphone Sennseheiser, I Pad, I Phone 3G, dan Xbox dibagikan kepada 1 PL dan 4 SBA yang telah melakukan kegiatan per-SBA-an dengan unik dan menunjukan hasil kerja keras yang baik! Wuoooooowww.. Congrats for you guyysss, imma proud buddy! group hug!!!<br /><br />Many joys come and go but friendship is forever&hellip;&hellip;&hellip;.<br />I really had a night blast (and morning hangover). Thanks buat tim Brightom yang setia jewer-jewerin kita kalo bandel, tim Marlboro yang selalu support kita dan tim MFCI yang sudah menyiapkan acara performance booster dengan sangat menarik! And we always know that ONLY MARLBORO CAN DO! <br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/P1020152.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/team%20jakarta%201_1.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/temu%20kangen%20time_2.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/P1020195.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/P1020186.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/semua%20senaaangg.jpg" alt="" width="320" height="240" /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/between%20the%20angel.jpg" alt="" width="320" height="240" /></p>', NULL, '51.jpg', 1),
(52, 'Three Months: Our Final Destination', '2011-10-02 22:53:20', 'Mendengar kata investasi, yang pasti terdengar pertama kali ada bicara mengenai soal uang. Beberapa musisi pun tak kalah menyuarakan persepsi mereka bahwa uang tidak bisa membeli segalanya', '<p><span style="font-size: small;"><strong>Invest Now!</strong></span><br /><br />Mendengar kata investasi, yang pasti terdengar pertama kali ada bicara mengenai soal uang. Beberapa musisi pun tak kalah menyuarakan persepsi mereka bahwa uang tidak bisa membeli segalanya; mulai dari Hank Williams Jr, Queen, Jeelestone dalam lirik-lirik lagunya<em> &lsquo;Money can&rsquo;t buy Happiness&rsquo;</em> sampai seorang filosof Rousseau pun menyepakati hal tersebut<em> ''Money buys everything, except morality and citizens.''</em><br /><em>But-well-somehow- we can agree to say-who cares?</em> Karena pada faktanya- <em>we need it- we want it- and for some people that be what they aim to do.</em><br /><br /><em>But, in this section we won&rsquo;t talk about investing money. Not at all! We know, as brand ambassador, we&rsquo;ve passed many trials-tests-experiences- and we know <strong>we&rsquo;re</strong> <strong>SPECIAL</strong></em>. <em>But how to prove it? We are not the display that only looked by one point. Moreover, we&rsquo;re really known we have special consumer. We can&rsquo;t be someone special just only with showing our I Pad then talking &ldquo;Hey, I&rsquo;m brand Ambassador- and I have I Pad as a tool&rdquo;. We have to <strong>be something</strong></em>, <em>because</em> <strong><em>&ldquo;how people see ourselves depends how we see ourselves&rdquo;.</em></strong> <em>So, are u ready to invest?</em><br /><br /><span style="font-size: small;"><strong>Music- Fashion- Cars- Arts- Digital- Anything!</strong></span><br /><br /><em><strong>Knowing anything around you!</strong> It could be anything.</em> Bukan berarti lo harus memaksakan diri untuk menyukai sesuatu yang nggak lo sukai. <em>But, it&rsquo;s important for us to know about anything. <strong>Your knowledge is your investment</strong>.</em> Suka musik indie bukan berarti enggak perlu tau perkembangan musik top 40 European. Still, suka musik hi-style orang bule punya bukan berarti nggak perlu tau selera yang kita sebut <strong>agan-agan</strong> kita. <strong><em>Open our mind to explore!</em></strong> Suka ngotak-ngatik sepeda karena lagi hits-hitsnya fixie bukan berarti nggak mau tahu kalau sekarang Mercedes AMG SLS Roadster sudah memiliki sistem internet <em>browsing- hotspot</em> WLAN dan lebih lagi Android bahkan suatu hari akan memiliki aplikasi yang lebih canggih. Bayangin kalau sebagai brand ambassador kita menghadapi orang atau <em>consumer</em> kita yang berbeda-beda. Mungkin suatu hari kita bisa menghadapi penyuka musik Jason Derulo, DJ Tiesto atau Maroon five, lalu tiba-tiba kita berhadapan dengan pencinta musik Kimbra. Tentunya intreraksi<em><strong> face two face</strong></em> kita bakal lebih menyenangkan kalau kita mau tahu lebih banyak! <br /><br /><br /><span style="font-size: small;"><strong>Connectivity- Social Life.</strong></span><br /><br />Sebutlah kita gaul. <em>Can we prove it?</em> Pasti banyak yang menerima statement dari orang banyak, seperti &ldquo;Oh lo brand ambassador, lo pasti gaul ya&rdquo;. <em>Then after we know we say yes, Then what?</em> Dari beberapa sharing banyak orang sukses, banyak yang mengakui kalau mereka bertahan eksis dan bisa <em>achieving</em> goal mereka dikarenakan beberapa hal dan yang terbesar adalah <strong><em>&lsquo;curiosity</em> untuk peka terhadap sekitar dan <em>social network&rsquo;.</em></strong> <br />Dan ini pastinya bakal jadi bekal kita untuk beraksi di <strong>Marlboro Lights Connection.</strong><br /><br /><em>Another thing is our talent.</em> Diantara kita pasti berbeda dan memiliki karakteristik masing-masing.<strong><em> But again, explore it! Don&rsquo;t stop to know yourself more and others.</em></strong> Jangan sampe kita cuma di bilang brand ambassador yang <em>party-party</em> dan <em>party</em> terus :P<br /><br />Jelas ada investasi yang lebih berharga dari uang itu sendiri.<strong> Love your work, so money will flow.</strong> <br /><br />Tiga bulan lagi adalah waktu yang berharga untuk memanfaatkan kesempatan kita menjadi <strong>brand ambassador Marlboro. Let&rsquo;s prove we deserve! Let&rsquo;s prove we are not only good, we&rsquo;re great!</strong> Jangan sampai suatu saat kita nyesel karena kita belum melakukan yang terbaik sebagai Brand Ambassador.<br /><br /><strong>Keep investing</strong><br /><strong>Go higher</strong> <br /><br /><strong>And then </strong><br /><strong>Are u ready to be a legend?</strong><br /><br /><img style="vertical-align: middle; margin: 5px; border: 5px solid black;" src="contents/uploads/Picture1_1.jpg" alt="" width="336" height="255" /><br /><br /><strong>Yeah, We&rsquo;ll be the next legend!</strong><br /><br /><strong>Regards</strong><br /><br /></p>', NULL, '52.jpg', 1);
