(1, 'AC0000127', '29D4FF', NULL, 'Lulur Susu Nathanea', 'lulur harum, lulur halus, kulit halus, lulur tidak lengket, lulur murah, lulur susu', 'Lulur murah, harum dan tidak lengket', NULL, 'PT Nathanea Indonesia', '<p style="text-align: justify;"><span style="font-family: ''comic sans ms'', sans-serif;"><span style="color: #ffffff;"><span style="background-color: #800080;">Lulur susu untuk menghaluskan kulit badan. Pakai setiap hari sebelum mandi. Anda akan merasakan sensasi butir biru yang menjaga kesegaran dan keharuman kulit.</span></span></span></p>', '1de88863ae39a417fc4a00df691c7014.jpg', '', '<p>Jadi kalau "<strong>mau cantik...tidak perlu mahal</strong>", ada <strong>Lulur Susu Nathanea</strong> solusinya.</p>', 'Lulur Susu Nathanea', '"Mau Cantik...Tak Perlu Mahal"', '2010-08-13 23:12:06', '', 0, 1),
