(16, 'AC0000364', 'FFFFFF', NULL, 'asiakita.com/gama', 'bca, mandiri, investasi, bank', 'investasi bisnis tepat', NULL, 'gama', '<p>ROBERT T.KIYOSAKI berkata : Saatnya uang yang bekerja untuk kita,bukan kita yang bekerja untuk uang.<br />DONALD TRUMP : Setiap ada peluang jangan hanya dilihat,dibaca dan didiskusikan tanpa berbuat apa-apa.<br /><br />INGAT...!<br /><br />ORANG-ORANG YANG SUKSES SELALU BERFIKIR POSITIF.<br />ORANG-ORANG YANG TIDAK SUKSES SELALU BERFIKIR NEGATIF.<br />ORANG-ORANG YANG SUKSES MENCIPTAKAN PELUANG.<br />ORANG-ORANG YANG TIDAK SUKSES MENUNGGU PELUANG.<br />Keragu-raguan hanya membuat anda jalan di tempat dan menghambat langkah anda untukmenuju kesuksesan<br /><br />Selamat datang di Program investasi "ASIAKITA"<br /><br />Jika anda tertarik dengan program ini silahkan mendaftar/registrasi caranya:<br /><br />1. Klik menu"Join this Group" atau "gabung ke grup ini"<br /><br />2. Klik "Invite People to Join" atau "undang orang untuk bergabung"<br /><br />3. Centang semua teman anda, Klik Tombol "Send Invitations"<br /><br />4. Klik "kembali ke CARI TEMAN DAPAT DUIT"<br /><br />5. Klik dsini http://asiakita.com/gama<br /><br />Program ini ditujukan bagi siapa saja yang saat ini membutuhkan bantuan dana untuk keperluan yang positif seperti :<br /><br />* Investasi membuka/mengembangkan usaha<br />* Biaya sekolah atau kuliah (Beasiswa), dalam dan luar negeri<br />* Kegiatan sosial, termasuk LSM<br />* dan sebagainya.<br /><br />Dalam  program ini tersedia dana dengan jumlah tak terbatas yang berasal dari  ribuan sumber sehingga memungkinan bagi siapa saja untuk mendaftar dan  berpeluang mendapatkan dana hibah, tanpa perlu mengembalikan, dan tanpa  syarat apapun !!!.<br /><br />Program ini merupakan program yang  mengutamakan kebersamaan, dengan prinsip dari kita, oleh kita dan untuk  kita, bersifat terbuka dan tidak ada pihak yang secara langsung bisa  mengontrol ataupun bertanggung jawab terhadap sistem secara keseluruhan.<br /><br />Cara Kerja Program Investasi "ASIAKITA"<br />http://asiakita.com/carakerja.php?id=gama<br />http://asiakita.com/ilustrasi.php<br /><br />Konsep  Program Investasi ini adalah memberikan kesempatan kepada siapa saja  untuk mendaftar dengan cara mentransfer sejumlah uang ke 4 (empat) nomor  rekening yang tertera (kita sebut sebagai Sponsor Bronze, Silver, Gold,  dan Platinum),<br />kemudian setiap member yang mendaftar akan diaktifkan  oleh minimal salah satu Sponsor dan berhak memperoleh replika website  pribadi Program Investasi AsiaKita atas nama member tersebut yang siap  di informasikan kepada siapa saja lewat iklan, email, SMS, mIRC,  Yahoo/MSN Messenger, ICQ,Facebook,Friendster, banner,surat,iklan  koran,majalah, dsb.<br /><br />Tugas utama anda adalah melakukan iklan dan  promosi sebanyak mungkin terhadap website pribadi anda, sehingga banyak  orang bergabung di Program Investasi ini atas sponsor anda.<br /><br />Ketika  terjadi duplikasi, setiap member baru akan menggeser posisi Sponsor di  atasnya sehingga member baru menjadi Bronze, member yang sebelumnya  Bronze menjadi Silver, Silver menjadi Gold, Gold menjadi Platinum, dan  Sponsor Platinum hilang dari daftar transfer di website anda. Semua  terjadi secara otomatis.<br /><br />Dengan asumsi dalam satu minggu  masing-masing orang melakukan promosi terhadap 20 orang member baru  (anda mensponsori 20 orang, kemudian masing-masing orang tadi  mensponsori 20 orang, dan seterusnya (terjadi duplikasi 4 kali)), maka  peluang hasil investasi anda adalah:<br /><br />Minggu ke 1 Bronze 20xRp.20.000,00 Rp. 400.000,-<br /><br />Minggu ke 2 Silver (20 x 20) xRp.20.000,00 Rp.8.000.000,-<br /><br />Minggu ke 3 Gold (20 x 20 x 20) xRp.20.000,00 Rp.160.000.000,-<br /><br />Minggu ke 4 Platinum (20 x 20 x 20 x 20) xRp.20.000,00 Rp. 3.200.000.000,-<br />==============================================<br />Total yang anda peroleh Rp.3.368.400.000,00<br /><br />Ya,  hanya dengan investasi 4 x Rp. 20.000,00 = Rp. 80.000,00, anda bisa  memperoleh income sebesar Rp. 3,36 Miliar lebih hanya dalam 4 minggu !!<br /><br />Jika  anda kurang beruntung, sistem duplikasi yang anda ciptakan hanya  berjalan 5 orang saja maka anda masih tetap berhak memperoleh Rp.15 Juta  lebih kurang dari 4 minggu.manfaatkan FACEBOOK anda untuk merekrut  teman-teman anda menjadi member di program investasi ini.semakin bayak  teman anda maka semakin besar peluang anda untuk sukses.<br /><br />Tidak ada batasan jumlah maksimal maupun minimal orang yang bisa anda sponsori, semua tergantung kemauan dan kerja keras anda.<br />Peran kontrol dan tanggung jawab dipegang sepenuhnya oleh seluruh member yang telah mendaftar dan aktif.<br /><br />Syarat Umum :<br />1. Warga Negara Indonesia maupun Asing, umur minimal 13 tahun.<br />2. Berdomisili di Wilayah Negara Republik Indonesia.<br />3. Memiliki Rekening Tabungan dan Kartu ATM Bank BCA,Bank lain.<br />4. Memiliki pengetahuan dasar Internet.<br />5. Jujur, bertanggung jawab.<br />6. Sanggup mematuhi segala peraturan Program Investasi "ASIAKITA"<br /><br />Apa yang akan Anda dapatkan dengan bergabung di Program Investasi ini :<br />1. Keanggotaan seumur hidup<br />2. Website Replika Pribadi<br />3. Puluhan E-Book yang sangat bermanfaat, bernilai Jutaan Rupiah<br />4. Jaringan kemitraan/partnership dengan member lain<br />5. Support dari para Sponsor<br />6. Potensi Income diatas Rp. 3 Milyar Rupiah<br /><br />Program  ini adalah independen, tidak ada hubungannya sama sekali dengan  pemerintah, pihak Bank BCA atau Group BCA lainnya ataupun lembaga  sosial/perseorangan. Namun secara keseluruhan program ini menggunakan  fasilitas Bank BCA sebagai media transaksi finansialnya.<br /><br />Program  ini adalah unik, karena pendiri/founder program justru tidak mendapatkan  keuntungan apapun, sehingga sistem ini tidak bisa ditiru. Program  Investasi Asia Kita diciptakan semata-mata dengan niat ikhlas untuk  membantu sesama.<br /><br />Konsep dasar dari program ini adalah bagaimana  caranya supaya setiap orang, baik yang kuat secara finansial maupun yang  lemah kemampuan finansialnya bisa memperoleh fasilitas pendanaan tak  terbatas, tanpa syarat, tanpa bunga, dan tanpa perlu mengembalikan,  namun dengan investasi yang sangat minim.<br /><br />Dengan harapan, Program  ini bisa/mampu memberdayakan masyarakat ekonomi lemah dan sektor  industri menengah ke bawah agar terbebas dari masalah permodalan yang  selama ini menjadi kendala mereka.<br /><br />Kunci utama Program Investasi  ini adalah kejujuran, disiplin dan tanggung jawab untuk mewujudkan rasa  saling percaya. Setiap member yang bergabung dalam Program Investasi ini  ketika melakukan transfer dana harus di-niat-kan secara tulus ikhlas  untuk beramal/shodaqoh membantu sesama, tidak atas dasar terpaksa atau  dalam tekanan siapapun, sehingga semua dana yang diperoleh member  Program Investasi AsiaKita sifatnya adalah SAH dan HALAL. Dana yang  diperoleh bisa disebut sebagai DANA HIBAH yang bisa anda manfaatkan  untuk berbagai keperluan tanpa harus mengembalikan.</p>', '', '', '', 'asiakita.com/gama', 'asiakita.com/gama', '2010-08-17 10:43:10', '', 0, 1),
