(87, 'AC0000031', 'FFFFFF', NULL, 'Menangkan iPad Idaman dari Indomog', 'iPad, Indomog, Facebook, Farmville, MafiaWars, Texas Holdem Poker', 'Undian iPad di INDOMOG', 'http://apps.facebook.com/indomog/index.php?act=undian', 'PT Indomog', '<p>Ayo, bergabung dengan Indomog di Facebook Anda!<br /><br />Setiap hari, anda mendapatkan 1 Indomog Point yang memberikan anda satu kesempatan untuk memenangkan iPad idaman anda. Semakin cepat anda mendaftar, semakin banyak kesempatan anda.<br /><br />iPad ini, dan puluhan hadiah lainnya, akan kami undikan bersamaan dengan pelunjuran product penjualan voucher ZYNGA (<strong>Farmville, Mafia War, Yoville, Texas Holdem Poker</strong>, dll) dalam</p>\r\n<p style="text-align: left;"><span style="font-size: medium;"><strong>20</strong></span><strong> hari lagi.</strong><br /><br />Jadi, entah karena anda mau beli voucher game, atau pulsa telpon, atau cuma karena mau punya iPAD, cepat klik disini.</p>', 'cc4c5bcf7d0d1c44e403fa668fb57429.jpg', 'c2f9231b17007450a905a326ea34f4f8.jpg', '<p><br />(semua pajak untuk hadiah hadiah diatas akan ditanggung Indomog. Indomog tidak akan meminta uang APAPUN untuk berpartisipasi dalam undian ini)</p>', 'MAU MENANG IPAD???!!!', 'Ikut Indomog! Menangkan iPad dan hadiah lainnya!', '2010-08-25 20:03:59', '', 0, 1),
