INSERT INTO `layout` (`id`, `user_id`, `bgcolor`, `fontcolor`, `page_title`, `meta_tags`, `meta_description`, `link_website`, `meta_author`, `content`, `logo_img`, `banner_img`, `footer_text`, `header_title`, `header_subtitle`, `created_time`, `google_analytics`, `status`, `published`) VALUES
(90, 'AC0000652', '0A0A0A', NULL, 'PO. KHARISMA NAGA PERSADA', 'bisnis menguntungkan', 'bisnis menguntungkan dengan sistem pasif income', 'http://www.kharisma.nagapersada.com', 'PO. KHARISMA NAGA PERSADA', '<h2>ARTI SEBUAH NAMA</h2>\r\n<p align="justify">Berawal dari keinginan  memiliki produk tunggal yang dipasarkan secara eksklusif, maka pada  pertengahan bulan April 2009 tercetuslah ASSIKHA                           sebagai &ldquo;merk&rdquo; resmi yang di usung oleh PT.  Flash Net International. Pemilihan nama ASSIKHA sendiri disesuaikan  dengan misi dan visi dari                        PT Flash Net International yang memiliki arti yang  sangat mendalam, yaitu &ldquo;dermawan&rdquo;.</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<h2>PENDAFTARAN MEREK ASSIKHA</h2>\r\n<div><img class="thumbleft" src="http://fners.com/images/dok_pendaftaranmerekassikha.jpg" alt="" align="right" /></div>\r\n<p align="justify">Pada tanggal 22 Oktober 2009, PT. Flash Net  International telah mengajukan "Permintaan Pendaftaran Merek" kepada  Direktorat Jenderal Hak Kekayaan Intelektual, Departemen Hukum dan Hak  Asasi Manusia Republik Indonesia. Hal ini dilakukan untuk melindungi  Merek Dagang ASSIKHA dan meyakinkan terhadap Member/ Distributor bahwa  dengan ini maka Merek Dagang ASSIKHA hanya dimiliki oleh PT. Flash Net  International.    <br /> Hak Merek ASSIKHA ini dapat digunakan untuk jenis Rokok Kretek,  Filter bahkan Cigarillos (Cerutu Kecil).</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<h2>KEKAYAAN RAMUAN TRADISIONAL BUMI NUSANTARA DALAM SATU  KEMASAN</h2>\r\n<div><img class="thumbcontent" src="http://fners.com/images/ramuan.jpg" alt="" width="300" height="219" align="left" /></div>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">ASSIKHA adalah rokok kretek  yang terdiri dari beberapa ramuan dan rempah-rempah dari bumi nusantara,  melalui serangkaian proses peracikan                            oleh tangan-tangan para ahli yang memiliki  pengalaman lebih dari 35 tahun.                             Ramuan standar pada ASSIKHA antara lain  Kapulaga (Amamum Campactum Soland), Kulit Pisang Raja, Madu Hutan, Siwak  (Salvadore Persica),                            Jinten Hitam (Nigella Sativa), Kayu Manis,  Sirih, Jahe, Kencur, Ketumbar, Lada Hitam dan masih banyak rempah-rempah  lain hingga Tembakau dan                            Cengkeh berkualitas. Dan pada masing-masing  variant nya ditambahkan ramuan-ramuan lain sebagai pendukung yang  menyempurnakan rasa.</p>\r\n<p align="justify">Berdasarkan ramuan  tradisional yang non-kimiawi tersebut, ASSIKHA masuk kedalam kategori <strong>rokok  rendah Nikotin</strong>.                             Hal ini dibuktikan dengan analisa Laboratorium  Penguji PT. Bentoel Prima Malang pada tanggal 27 Agustus 2009  diterbitkan Laporan Hasil Uji                            Rokok ASSIKHA GOLD 12 Batang yang menyatakan  Kadar Nikotin sebesar 0.16 mg dan TAR sebesar 52.09 mg, lalu pengujian  ASSIKHA CLASSIC                        12 Batang pada tanggal 4 Januari 2010 dinyatakan  memiliki Kadar Nikotin sebesar 0.54 mg dan TAR sebesar 38.45 mg.</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<h2>KHASIAT KANDUNGAN RAMUAN</h2>\r\n<div><!-- Ramuan Begin --> <img class="paddingright" src="http://fners.com/images/icon_kapulaga.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="white" align="justify"><span class="titlepane"><br /> <span class="titlenews">Kapulaga (<em>Amamum Campactum Soland</em>)</span></span></p>\r\n<p align="justify">Kapulaga memiliki  aroma bau sedap  sehingga orang Inggris menyanjungnya sebagai <em>grains of paradise</em>.  Aroma sedap ini berasal dari kandungan minyak <em>atsiri</em> pada  kapulaga. Minyak <em>atsiri</em> ini mengandung  lima zat utama, yaitu <a href="http://id.wikipedia.org/w/index.php?title=Borneol&amp;action=edit&amp;redlink=1" target="_blank"><em>borneol</em></a> yang berbau kamper seperti yang  tercium dalam getah pohon kamper, <a href="http://id.wikipedia.org/w/index.php?title=Alfa-terpinilasetat&amp;action=edit&amp;redlink=1" target="_blank"><em>alfa-terpinilasetat</em></a> yang harum seperti bau  jeruk <em>pettigrain</em>, <a href="http://id.wikipedia.org/w/index.php?title=Limonen&amp;action=edit&amp;redlink=1" target="_blank"><em>limonen</em></a> yang juga harum seperti bau jeruk  keprok alfa <a href="http://id.wikipedia.org/w/index.php?title=Terpinen&amp;action=edit&amp;redlink=1" target="_blank"><em>terpinen</em></a> yang harum seperti jeruk sitrun <a href="http://id.wikipedia.org/wiki/Cineol" target="_blank"><em>cineol</em></a> yang sedap agak pedas menghangatkan seperti <a href="http://id.wikipedia.org/wiki/Minyak_kayu_putih"><em>minyak </em></a><em><a href="http://id.wikipedia.org/wiki/Minyak_kayu_putih">kayu putih</a></em>.  Kombinasi inilah yang membentuk aroma khas kapulaga.</p>\r\n<p align="justify">Biji, yang diambil dari tumbuhan sebelum  buah masak benar, dapat dimanfaatkan sebagai obat. Dalam dunia  obat-obatan biji yang telah dikeringkan dinamakan <em>semen</em> <em>cardamomi</em>.  Selain bijinya, yang digunakan untuk obat adalah bagian akar, buah, dan  batangnya. Kapulaga mengandung minyak <em>atsiri</em>, <em>sineol</em>,  <em>terpineol</em>, <em>borneol</em>, <a href="http://id.wikipedia.org/wiki/Protein" target="_blank"><em>protein</em></a>,  <a href="http://id.wikipedia.org/wiki/Gula" target="_blank">gula</a>, <a href="http://id.wikipedia.org/wiki/Lemak" target="_blank">lemak</a>, <a href="http://id.wikipedia.org/wiki/Silikat" target="_blank"><em>silikat</em></a>,  <em>betakamfer</em>, <em>sebinena</em>, <em>mirkena</em>, <em>mirtenal</em>,  <em>karvona</em>, <em>terpinil asetat</em>, dan <em>kersik</em>. Dari  kandungan tersebut kapulaga memiliki khasiat sebagai obat batuk.  Kapulaga juga memiliki khasiat untuk mencegah keropos tulang.</p>\r\n<p class="white" align="justify">&nbsp;</p>\r\n<p class="white" align="justify"><img class="paddingright" src="http://fners.com/images/icon_kulitpisangraja.png" alt="" width="100" height="111" align="left" /></p>\r\n<p class="white" align="justify"><span class="titlepane"><br /> </span><span class="titlenews">Ekstrak Kulit Pisang Raja</span></p>\r\n<p align="justify">Tumbuhan pisang adalah suatu tumbuhan yang  dapat tumbuh secara potensial di Indonesia. Tumbuhan pisang dapat tumbuh  di daerah pantai maupun di daerah pegunungan. Hampir semua wilayah yang  ada di Indonesia dapat ditumbuhi tumbuhan pisang.</p>\r\n<p align="justify">Selama ini, masyarakat selalu mengkomsumsi  buah dari tumbuhan pisang. Kunsumen pada umumnya setelah makan buah  pisang lalu membuang kulitnya karena menganggap sampah (limbah buah  pisang). Menurut <em>Besse</em> (2000 : 2) jumlah dari kulit buah pisang  cukup banyak, yaitu kira-kira 1/3 dari buah pisang yang belum dikupas.</p>\r\n<p align="justify">Hasil penelitian tim Universitas <strong>Kedokteran  Taichung Chung Shan,  Taiwan</strong>, memperlihatkan bahwa ekstrak  kulit pisang ternyata berpotensi mengurangi gejala depresi dan menjaga  kesehatan retina mata. Selain kaya vitamin B6, kulit pisang juga  ternyata banyak mengandung <em>serotonin</em> yang sangat vital untuk  menyeimbangkan <em>mood</em>. Selain itu, ditemukan pula manfaat ekstrak  pisang untuk menjaga retina dari kerusakan cahaya akibat regenerasi  retina. Dalam studi klinis yang dilakukan, para peneliti membandingkan  efek ekstrak kulit pisang bagi retina mata pada dua kelompok. Pertama  adalah kelompok kontrol dan kelompok kedua adalah responden yang diberi  ekstrak kulit pisang dan mereka dipapari cahaya selama enam jam dalam  dua hari. Hasilnya, mereka yang tidak mendapat ekstrak kulit pisang sel  retinanya menjadi mati, sedangkan kelompok lainnya retinanya tidak  mengalami kerusakan.Meski belum ada penjelasan ilmiahnya, para ahli  meyakini rendahnya kadar serotonin di dalam otak akan menyebabkan  timbulnya depresi. <em>Serotonin</em> yang cukup akan membuat seseorang  tenang dan <em>rileks</em>.</p>\r\n<p class="white" align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_maduhutan.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="white" align="justify"><span class="titlepane"><br /> </span><span class="titlenews">Madu Hutan Klanceng</span></p>\r\n<p align="justify">Pada awal tahun 1700-an, Permaisuri Anne dari  England telah mencoba bahan campuran madu &amp; minyak zaitun agar  rambutnya sehat dan bersinar. Kajian terbaru membuktikan sebagian atlit  yang mengkonsumsi madu sebelum dan sesudah  bertanding dapat mengembalikan stamina lebih cepat dari mereka yang  tidak mengkonsumsi madu.</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">FAKTA MENAKJUBKAN  MENGENAI MADU DAN  KESEHATAN :</p>\r\n<div><ol>\r\n<li>Madu mengandungi vitamin dan anti oksidan tetapi bebas  lemas, kolestrol dan garam.</li>\r\n<li> Mempunyai <em>antioksidan</em> pada paras kandungan  yang sama dalam bayam dan ia baik   untuk kesihatan jantung anda.</li>\r\n<li>Sejak bertahun-tahun, penyanyi opera yang bersuara  lantang mengamalkan madu   untuk meningkatkan tenaga dalam badan &amp; melegakan tekak sebelum  membuat   persembahan.</li>\r\n<li>Madu adalah satu-satunya makanan yang mengandungi  semua unsur yang perlu   untuk kehidupan termasuk air.</li>\r\n<li>Madu mempunyai keupayaan untuk menarik dan menyerap  lembapan, oleh itu ia   sangat mujarab untuk merawat luka terbakar yang kecil dan mencegah  parut.</li>\r\n<li>Madu mempercepat penyembuhan luka terbuka dan melawan  jangkitan.</li>\r\n<li>Seawal Perang Dunia Pertama, madu telah dicampurkan  dengan minyak ikan kod   untuk merawat &amp; mencuci luka di medan perang.</li>\r\n<li>Madu dan sarang lebah merupakan bahan asas kepada krim  kulit, lipstik dan losyen   tangan.</li>\r\n</ol></div>\r\n<p class="white" align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_kayusiwak.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="white" align="justify"><span class="titlepane"><br /> </span><span class="titlenews">Salvadore Persica (Siwak)</span></p>\r\n<p align="justify">Sejak zaman dahulu, manusia telah mengenal  beberapa variasi teknik dalam membersihkan gigi. Mulai dari bulu ayam,  duri landak, tulang hingga kayu dan ranting-ranting digunakan sebagai  alat pembersih gigi. Penelitian terbaru terhadap kayu siwak menunjukkan  bahwa siwak mengandung mineral-mineral alami  yang dapat membunuh bakteri, menghilangkan plaque, mencegah gigi  berlubang serta memelihara gusi.  Siwak memiliki kandungan kimiawi yang bermanfaat, seperti :</p>\r\n<div>\r\n<ul>\r\n<li> <em>Antibacterial Acid</em>s, seperti <em>astringents</em>,  <em>abrasive</em> dan <em>detergents</em> yang berfungsi untuk membunuh  bakteri,   mencegah infeksi dan menghentikan pendarahan pada gusi. Pada penggunaan  siwak pertama kali,   mungkin terasa pedas dan sedikit membakar, karena terdapat kandungan  serupa <em>mustard</em> di dalamnya  yang merupakan <em>substansi  antibacterial acids</em> tersebut.</li>\r\n<li>Kandungan kimia seperti <em>Klorida</em>, <em>Pottasium</em>,  <em>Sodium Bicarbonate</em>, <em>Fluoride</em>, <em>Silika</em>, <em>Sulfur</em>,  Vitamin C,  &nbsp; <em>Trimethyl  amine</em>, <em>Salvadorine</em>, <em>Tannins</em> dan  beberapa mineral lainnya yang berfungsi untuk membersihkan   gigi, memutihkan dan menyehatkan gigi dan gusi. Bahan-bahan ini sering  diekstrak sebagai bahan   penyusun  pasta gigi.</li>\r\n<li> Minyak aroma alami yang memiliki rasa dan bau yang  segar, menjadikan mulut menjadi harum dan   menghilangkan bau tak sedap.</li>\r\n<li> <em>Enzim</em> yang mencegah pembentukan <em>plaque</em> yang menyebabkan radang gusi. <em>Plaque</em> juga merupakan   penyebab utama tanggalnya gigi secara premature.</li>\r\n<li><em>Anti decay agent</em> (Zat anti pembusukan), yang  menurunkan jumlah bakteri di mulut dan mencegah proses   pembusukan. Selain itu siwak juga turut merangsang produksi saliva (air  liur) lebih, dimana saliva              merupakan organik mulut yang melindungi dan membersihkan  mulut. </li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify"><img class="paddingright" src="http://fners.com/images/icon_jintenhitam.png" alt="" width="100" height="111" align="left" /></p>\r\n<p align="justify"><span class="titlepane"><br /> </span><span class="titlenews">Nigella Sativa (Jinten Hitam)</span><br /> Jinten hitam (<em>Nigella  sativa</em>) atau <em>Habbatussauda</em> adalah rempah-rempah yang dapat pula digunakan sebagai tanaman obat.  Rempah ini berbentuk butiran biji berwarna hitam yang telah dikenal  ribuan tahun yang lalu dan digunakan secara luas oleh masyarakat India,  Pakistan, dan Timur Tengah untuk mengobati berbagai macam penyakit.</p>\r\n<p align="justify">Jinten Hitam banyak dikenal dengan berbagai nama,  diantaranya <em>black</em> <em>seed</em>, <em>black</em> <em>caraway</em>,  <em>black</em> <em>seed</em>, <em>natura</em> <em>seed</em>, jintan  hitam, <em>black</em> <em>cumin</em>, <em>nigella</em> <em>sativa</em>, <em>kaluduru</em>,  dll. Digunakan sebagai herbal pengobatan sejak 2000-3000 tahun sebelum  Masehi dan tercatat dalam banyak literatur kuno mengenai ahli pengobatan  terdahulu.</p>\r\n<p align="justify">Manfaat utama Jinten  Hitam :</p>\r\n<div>\r\n<ul>\r\n<li> Memperkuat sistem kekebalan tubuh dari serangan Virus, Kuman  dan Bakteri. </li>\r\n<li> Mempertahankan tubuh dari serangan kanker dan HIV. </li>\r\n<li>Menghentikan  pertumbuhan sel tumor.</li>\r\n<li>Meningkatkan fungsi otak, dengan kandungan asam linoleat (Omega  6) dan asam  linolenat (Omega 3), meningkatkan daya ingat, kecerdasan,  dan relativitas sel otak agar  tidak cepat pikun. </li>\r\n<li>Memperbaiki mikro (peredaran darah) ke otak dan sangat cocok  diberikan pada lansia.</li>\r\n<li>Meringankan berbagai jenis penyakit pernafasan, asma <a href="http://id.wikipedia.org/w/index.php?title=Bronchial&amp;action=edit&amp;redlink=1">bronchial</a>,  <a href="http://id.wikipedia.org/wiki/Bronchitis">bronchitis</a>,  gampang   lelah, batuk kronis dan penyakit pernafasan lainnya. </li>\r\n<li> Mengatasi gangguan tidur dan stress.</li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_kayumanis.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Kayu Manis</span></p>\r\n<p align="justify">Kayu berkulit kasar itu  ternyata tersusun dari  senyawa <em>sinamaldehid</em>. <em>Sinamaldehid</em> merupakan turunan   dari senyawa <em>fenol</em>. Di dunia kedokteran, senyawa <em>sinamaldehid</em> diketahui memiliki sifat  anti-agregasi <em>platelet</em> dan sebagai <em>vasodilator</em> secara<em> in vitro</em>. <em>Platelet</em> adalah  kolesterol yang  menempel pada pembuluh darah. <em>Agregasi</em> (pengumpulan) platelet   menyebabkan terjadinya <em>asterosklerosis</em> atau lemak mengeras di  pembuluh arteri  pada makhluk hidup. Manfaat dari kayu manis. Dibawah  ini ada beberapa penyakit yang bisa diobati dengan ramuan dari kayu  manis :</p>\r\n<div>\r\n<ul>\r\n<li> Sakit Perut.<br /> membersihkan perut serta menyembuhkan bisul hingga keakar-akarnya. </li>\r\n<li>Kembung.<br /> Penelitian  yang dilakukan di India dan Jepang menyatakan bahwa  madu&nbsp;yang diminum      bersama kayu manis panas dapat membuat nafas tetap&nbsp; segar sehari  penuh. </li>\r\n<li>Sakit Kepala dan Sinus.</li>\r\n<li>Kelelahan<br /> Warga usia lanjut yang mengkonsumsi madu dan bubuk kayu manis  dengan&nbsp;ukuran  sama, terbukti lebih waspada dan fleksibel. </li>\r\n<li>Influenza</li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_sirih.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Sirih</span></p>\r\n<p align="justify">Sirih (<em>Piper betle L atau Chavica aurculata Miq</em>)  memang mudah ditanam. Cukup dengan menggunakan stek dan diberi cukup  air, tanaman ini bisa tumbuh baik di tempat panas maupun di tempat  yang  terlindung. Sirih sangat kaya dengan kandungan zat berkhasiat. Di antaranya, minyak <em>atsiri</em>,  <em>hidroksikavicol</em>, <em>kavicol</em>, <em>kavibetol</em>, <em>allylpyrokatekol</em>,  <em>cyneole</em>, <em>caryophyllene</em>, <em>cadinene</em>, <em>estragol</em>,  <em>terpennena</em>, <em>seskuiterpena</em>, <em>fenil propana</em>, <em>tanin</em>,  <em>diastase</em>, gula, dan pati.</p>\r\n<p align="justify">Efek zat aktif  yang dikandung seluruh bagian tanaman  sirih adalah merangsang syaraf pusat, merangsang daya pikir,  meningkatkan gerakan <em>peristaltik</em>, merangsang kejang, meredakan  sifat mendengkur. Daun sirih memiliki efek mencegah ejakulasi prematur,  mematikan jamur <em>Candida</em> <em>albicans</em>,  anti kejang, <em>analgesik</em>,  <em>anestetik</em>, pereda kejang pada otot polos, penekan pengendali  gerak, mengurangi sekresi cairan pada liang  vagina, penekan kekebalan  tubuh, pelindung hati, dan <em>antidiare</em>, mengatasi batuk, <em>bronchitis</em>,  menghilangkan bau badan, mengobati luka bakar, mimisan, bisul, mata  gatal dan merah, koreng dan gatal-gatal, menghentikan pendarahan gusi,  sariawan, menghilangkan bau mulut, jerawat, keputihan, dan mengurangi  produksi air  susu ibu yang berlebihan.</p>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_jahe.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Jahe</span></p>\r\n<p align="justify">Penelitian  modern telah membuktikan secara ilmiah  berbagai manfaat jahe, antara lain :</p>\r\n<div>\r\n<ul>\r\n<li>Menurunkan tekanan darah. Hal ini karena jahe merangsang  pelepasan &nbsp;&nbsp;hormon <em>adrenalin</em> dan memperlebar pembuluh darah, akibatnya  darah mengalir  &nbsp; lebih cepat dan lancar dan memperingan kerja jantung memompa darah. </li>\r\n<li>Membantu pencernaan, karena jahe mengandung enzim pencernaan  yaitu   <em>protease</em> dan <em>lipase</em>, yang masing-masing mencerna  protein dan lemak.</li>\r\n<li> <em>Gingerol</em> pada jahe bersifat <em>antikoagulan</em>,  yaitu mencegah penggumpalan   darah. Jadi mencegah tersumbatnya pembuluh darah, penyebab utama <em>stroke</em>,    dan serangan jantung. <em>Gingerol</em> juga diduga membantu menurunkan  kadar   kolesterol. </li>\r\n<li>Mencegah mual, karena jahe mampu memblok <em>serotonin</em>,  yaitu senyawa kimia   yang dapat menyebabkan perut berkontraksi, sehingga timbul rasa mual. &nbsp;  Termasuk mual akibat mabok perjalanan. </li>\r\n<li>Membuat lambung menjadi nyaman, meringankan kram perut dan  membantu   mengeluarkan angin. </li>\r\n<li>Jahe juga mengandung <em>antioksidan</em> yang membantu  menetralkan efek   merusak yang disebabkan oleh radikal bebas di dalam tubuh. </li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_kencur.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Kencur</span></p>\r\n<p align="justify">Kencur (nama bahasaJawa dan bahasa Indonesia) dikenal  di berbagai tempat dengan nama yang berbeda-beda: cikur (bahasaSunda);  ceuko (bahasa Aceh); kencor (Madura); cekuh (bahasa Bali); kencur,  sukung (bahasaMelayu Manado); asauli, sauleh, soul, umpa (bahasa-bahasa  di Maluku); serta cekir (Sumba).</p>\r\n<p align="justify">Berbagai masakan tradisional  Indonesia dan jamu  menggunakan kencur sebagai bagian resepnya. Kencur dipakai orang sebagai  tonikum dengan khasiat menambah nafsu makan sehingga sering diberikan  kepada anak-anak. Jamu beraskencur sangat populer sebagai minuman  penyegar pula. Di Bali, urap dibuat dengan menggunakan daun kencur.</p>\r\n<p align="justify">Kencur, bahasa latinnya Kaempferia galangal L, dapat  dimanfaatkan untuk berbagai macam kebutuhan. Si kecil serbaguna ini  dapat dipakai sebagai bahan baku jamu (obat tradisional), fitofarmaka,  industry kosmetika, penyedap makanan dan minuman, rempah, serta bahan  campuran saus rokok kretek. Secara empirik kencur digunakan sebagai  penambah nafsu makan, infeksi bakteri, obat batuk, disentri, tonikum,  ekspektoran, masuk angin dan sakit perut.</p>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_ketumbar.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Ketumbar</span></p>\r\n<p align="justify">Manfaat dari tumbuhan ini sudah banyak dirasakan di  berbagai negara. Ketumbar biasanya digunakan pelancar pencernaan,  peluruh kentut (carminative), peluruh ASI (lactago), dan penambah nafsu  makan (stomachica).</p>\r\n<p align="justify">Manfaat ketumbar diambil dari daun, biji dan buah.  Dari semua bagian tanaman yang diubah menjadi minyak terbang terdapat  kandungan berupa sabinene, myrcene, a-terpinene, ocimene, linalool,  geraniol, dekanal, desilaldehide, trantridecen, asam petroselinat, asam  oktadasenat,  d-mannite, skopoletin, p-simena, kamfena, dan felandren.  Selain itu dalam Cabe Puyang Warisan Nenek Moyang (Balai Pustaka 1996)  disebutkan bahwa ketumbar juga mengandung lemak dan abu.</p>\r\n<p align="justify">Dari ensiklopedi Wikipedia disebutkan bahwa  khasiatnya tak sebatas pelancar pencernaan saja. Ketumbar juga berguna  untuk meredakan pusing, muntah-muntah, influenza, wasir, radang lambung  dan radang payudara, campak, masuk angin, tekanan darah tinggi, dan  lemah syahwat. Penggunaan ketumbar bisa dilakukan dengan berbagai cara  ditumbuk halus dan direbus, baik untuk pengobatan luar, maupun dalam.</p>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_ladahitam.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Lada Hitam</span></p>\r\n<p align="justify">Di antara keluarga rempah-rempah, lada hitam (Piper   nigrum) atau black pepper adalah jenis&nbsp;rempah-rempah yang paling  populer. Ditemukan pertama kali  di Malabar, pantai barat India bagian  Selatan sekitar 2000 tahun yang lalu.  Kini lada banyak ditanam di  wilayah Asia, terutama Malaysia dan Indonesia.</p>\r\n<p align="justify">Kandungan kimia dalam&nbsp;lada hitam&nbsp;adalah saponin,  flavonoida, minyak atsiri, kavisin, resin, zat putih telur, amilum,  piperine, piperiline, piperoleine, poperanine, piperonal, dihdrokarveol,  kanyo-fillene oksida, kariptone, tran piocarrol, dan minyak lada. Sifat  kimiawi lada adalah pedas dan beraroma&nbsp;sangat khas.</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">Lada hitam memiliki banyak khasiat. Di antaranya  adalah untuk melancarkan menstruasi, meredakan serangan asma,  meringankan gejala rematik, mengatasi perut kembung, serta menyembuhkan  rasa sakit kepala.</p>\r\n<p align="justify">&nbsp;</p>\r\n<div><img class="paddingright" src="http://fners.com/images/icon_cengkeh.png" alt="" width="100" height="111" align="left" /></div>\r\n<p class="titlepane" align="justify"><br /> <span class="titlenews">Cengkeh</span></p>\r\n<p align="justify">Bagaimana dengan khasiatnya ? Mungkin sebagian orang  hanya tahu, kegunaan cengkeh itu hanya sebagai bahan baku rokok, atau  untuk menghilangkan bau mulut.<br /> <br /> Namun, ternyata ada lagi khasiat-khasiat dari buah cengkeh ini,  diantaranya :<br /> 1. Dapat digunakan sebagai bumbu, baik dalam bentuknya yang utuh ataupun    ditumbuk halus, sehingga berbentuk bubuk. <br /> 2. Digunakan sebagai bahan rokok kretek. <br /> 3. Cengkeh dibuat minyak, lalu minyak cengkeh tersebut digunakan  sebagai   aromaterapi.<br /> 4. Mengobati sakit gigi<br /> 5. Mengobati penyakit kolera dan menambah denyut jantung Mengobati  penyakit   campak<br /> 6. Menghitamkan alis mata</p>\r\n<p align="justify"><!-- ramuan end --></p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<h2>PERJANJIAN KERJASAMA ANTARA<br /> PT. FLASH NET INTERNATIONAL dengan PR. INDOKRETEK</h2>\r\n<div><img class="thumbcontent" src="http://fners.com/images/dok_perjanjiankerjasama.jpg" alt="" align="left" /></div>\r\n<p align="justify">Bentuk lain dari kepatuhan  pada Peraturan Menteri Perdagangan No : 32/M-DAG/PER/8/2008, Pasal 9  Ayat 1 Point 4 : Jika tidak memproduksi sendiri produknya, maka wajib  menyerahkan bukti kerjasama dengan pihak produsen sebagai suplier atau  distributor tunggal.</p>\r\n<p align="justify">Maka PT. Flash Net International mengikat PR.  Indokretek sebagai sebuah Perusahaan Rokok untuk berkomitmen dalam  pemenuhan kebutuhan rokok non kimiawi rendah nikotin dengan penambahan  ramuan alami yang merupakan Produk Utama dari PT. Flash Net  International melalui Akta Kerjasama No 08 yang ditetapkan di Kota  Malang tanggal 06 Oktober 2009 dihadapan Notaris H. Chusen Bisri, S.H.</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<h2>ATURAN PROMOSI PRODUK ASSIKHA</h2>\r\n<div><img class="paddingright" src="http://fners.com/images/warning.png" alt="" width="135" height="113" align="left" /></div>\r\n<p align="justify">Seiring waktu berjalan,  produk  ASSIKHA  telah diterima oleh <em><strong>fners</strong></em> dan  masyarakat. Hal ini terbukti dengan banyaknya <em><strong>fners</strong></em> yang melakukan promosi baik di media massa maupun dalam bentuk brosur.</p>\r\n<p align="justify">Dan berkaitan dengan hal  tersebut, kami Management PT. FLASH NET INTERNATIONAL menghimbau kepada  seluruh fners yang akan melakukan <span class="normal"><strong>promosi  produk ASSIKHA </strong></span>, diharapkan mengikuti aturan yang telah  di tetapkan Perusahaan.                        	Aturan Promosi yang di tetapkan oleh Perusahaan  adalah mengikuti Aturan Pemerintah yang tertuang pada PP No. 19 Tahun  2003 Tentang Kajian Dalam Memasarkan Produk  Rokok, pada pasal 17 antara  lain:</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify"><strong>Materi iklan  sebagaimana  dimaksud dalam Pasal 16 ayat (2) dilarang :</strong></p>\r\n<div>\r\n<ul>\r\n<li><strong>Merangsang  atau menyarankan  orang untuk merokok;</strong></li>\r\n<li><strong>Menggambarkan  atau menyarankan  bahwa merokok memberikan manfaat bagi kesehatan;</strong></li>\r\n<li><strong>Memperagakan  atau menggambarkan  dalam bentuk gambar, tulisan atau gabungan keduanya, bungkus  rokok,  rokok atau orang sedang merokok atau mengarah pada orang yang sedang   merokok;</strong></li>\r\n<li><strong>Ditujukan  terhadap atau  menampilkan dalam bentuk gambar atau tulisan atau gabungan  keduanya,  anak, remaja, atau wanita hamil;</strong></li>\r\n<li><strong>Mencantumkan  nama produk yang  bersangkutan adalah rokok;</strong></li>\r\n<li><strong>Bertentangan  dengan norma yang  berlaku dalam masyarakat.</strong></li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">Maka dapat disimpulkan bahwa,  pada Media Promosi Produk ASSIKHA, diharapkan:</p>\r\n<div>\r\n<ul>\r\n<li><span class="normal">TIDAK MENYEBUTKAN</span> bahwa ROKOK ASSIKHA  adalah rokok sehat, berdampak baik bagi kesehatan,  atau bahkan dapat menyembuhkan penyakit apapun.</li>\r\n<li><span class="normal">TIDAK MENCANTUMKAN</span> gambar Rokok, Bungkus Rokok, dan Orang yang sedang merokok.</li>\r\n<li><span class="normal">TIDAK MENGANJURKAN</span> orang lain untuk merokok.</li>\r\n<li><span class="normal">TIDAK MENYEBUTKAN</span> bahwa produk yang dipromosikan adalah ROKOK.</li>\r\n<li><span class="normal">MENCANTUMKAN</span> tulisan peringatan kesehatan yang mudah dilihat dan dibaca "MEROKOK  DAPAT MENYEBABKAN KANKER, SERANGAN JANTUNG,  IMPOTENSI DAN GANGGUAN  KEHAMILAN DAN JANIN" sebesar 30% dari luas media promo.</li>\r\n</ul>\r\n</div>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">Kami berharap, fners dapat memahami  aturan tersebut, dan jika fners memerlukan bantuan dalam pembuatan media  promosi ASSIKHA GOLD dapat menghubungi Brand &amp; Marketing  Communication PT. FLASH NET INTENATIONAL (<a href="mailto:marcomm@fners.com">marcomm@fners.com</a>).</p>\r\n<p align="justify">&nbsp;</p>\r\n<p align="justify">&nbsp;</p>\r\n<div class="breadcrumb"><span class="smallgrey">marketing plan &raquo;  memulai bisnis </span></div>\r\n<h2>MEMULAI BISNIS DI FLASH NET</h2>\r\n<p><img src="http://fners.com/images/grstitle.png" alt="" width="287" height="3" /></p>\r\n<p>&nbsp;</p>\r\n<p class="contenthighlight"><img class="thumbcontent" src="http://fners.com/images/thumb_memulaibisnis.png" alt="" align="left" /></p>\r\n<p class="contenthighlight">&nbsp;</p>\r\n<p class="contenthighlight">DALAM MENJALANKAN BISNIS DI FLASHNET,  DISTRIBUTOR MEMILIKI ATURAN MAIN YANG TELAH DISEPAKATI OLEH PERUSAHAAN  DAN KOMITE LEADER, HAL INI BERTUJUAN AGAR DALAM MELAKUKAN AKTIFITASNYA  DISTRIBUTOR MEMILIKI TARGET YANG AKAN DIRAIH BERSAMA TEAM NYA.</p>\r\n<p class="contenthighlight">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>&nbsp;<ol>\r\n<li>&nbsp;<ol>\r\n<li>&nbsp;<ol>\r\n<li>&nbsp;<ol>\r\n<li>Pendaftaran distributor baru dilakukan dengan  berinvestasi satu paket Starter Kit yang dapat diperoleh dari  Distributor / Upline, terdiri dari :<br /> a.   Form Pendaftaran.<br /> b.   Buku, yang terdiri dari RPU, Katalog dan Peraturan  Umum.<br /> c.   Merchandise.<br /> d.   1 Produk Rokok (ASSIKHA GOLD atau ASSIKHA  CLASSIC).<br /> </li>\r\n<li>Kartu Distributor dapat diperoleh 3 hari setelah  Formulir Pendaftaran diserahkan pada Petugas Point Operator dimana  Distributor terdaftar.<br /> </li>\r\n<li>Dalam hal Kartu belum jadi, pembelanjaan dapat  dilakukan dengan menggunakan Formulir Pendaftaran.</li>\r\n<li>Akumulasi pembelanjaan adalah jumlah pembelanjaan  bungkus per bulan sekaligus sebagai syarat pencairan bonus belanja.</li>\r\n<li>Pendaftaran untuk periode 12 bulan, otomatis  perpanjang jika distributor melakukan aktifitas belanja dan menutup  ketentuan belanja minimum pada saat bulan ke 12.</li>\r\n<li>Ketentuan belanja minimum adalah batas minimum  pembelanjaan pribadi setiap bulannya , yaitu 20 bungkus.</li>\r\n<li>Bonus Pengembangan Usaha didapatkan ketika kita  mendapatkan downline.</li>\r\n<li style="text-align: left;">Keanggotaan dapat diwariskan kepada ahli waris yang  tertera di Formulir Pendaftaran.<br /></li>\r\n</ol></li>\r\n</ol></li>\r\n</ol></li>\r\n</ol></li>\r\n</ol>', '95dc87f50cd18dd5bf47704708d078bf.jpg', 'BANNER_fd52120e814bdac289976a6e309cb7de.jpg', '<p>MANFAAT YANG DIPEROLEH DISTRIBUTOR SETELAH BERGABUNG DENGAN FLASHNET  TERDIRI DARI:</p>\r\n<p>&nbsp;</p>\r\n<h2>A. BONUS PENJUALAN LANGSUNG</h2>\r\n<p>Yaitu bonus yang diperoleh secara langsung yang merupakan  selisih atas penjualan Starter Kit dan Produk.</p>\r\n<p><strong class="contenthighlight">Selisih Starter Kit : </strong><br /> Merupakan selisih harga antara penjualan ke Calon Distributor  Baru dikurangi harga pembelian dari Point Operator, selisih ini kami  berikan sebagai imbalan atas jasa pengenalan usaha kepada Calon  Distributor Baru oleh Distributor yang sudah lebih dahulu masuk.</p>\r\n<p><img src="http://fners.com/images/ilustrasi_bonuslangsung1.png" alt="" width="377" height="214" /></p>\r\n<p>&nbsp;</p>\r\n<p><span class="contenthighlight">Selisih Produk : </span><br /> Merupakan selisih harga antara penjualan Produk ke Konsumen  Akhir dikurangi harga pembelian dari Point Operator.</p>\r\n<p><img src="http://fners.com/images/ilustrasi_bonuslangsung2.png" alt="" width="377" height="214" /></p>\r\n<p>&nbsp;</p>\r\n<h2>B. BONUS BELANJA</h2>\r\n<p>Bonus Belanja merupakan total bonus pembelanjaan pribadi dan  bonus pembelanjaan team. Bonus belanja pribadi dan team akan dihitung  secara otomatis oleh system jika Setiap Distributor melakukan  pembelanjaan minimum setiap bulannya sebanyak 20 Bungkus.</p>\r\n<p><span class="contenthighlight">Bonus Belanja Pribadi : </span><br /> Merupakan pengalian ''Jumlah Pengali'' Pribadi Dikali Total Jumlah  Bungkus Pembelanjaan pribadi  dalam satu bulan.</p>\r\n<p><span class="contenthighlight">Bonus Belanja Team Jaringan :</span> Merupakan pengalian Antara Total Jumlah Bungkus pembelanjaan Downline  dari setiap level Dikali dengan ''Jumlah Pengali'' sesuai Kedalaman Level  hingga level ke 10 dalam satu bulan.</p>\r\n<p>&nbsp;</p>\r\n<p class="normalboldblue">Tabel Jumlah Pengali</p>\r\n<table border="0" cellspacing="1" cellpadding="0" width="300">\r\n<tbody>\r\n<tr>\r\n<td class="titlegrid" width="9%" height="24" align="center" bgcolor="#cc3300">LEVEL</td>\r\n<td class="titlegrid" width="30%" height="24" align="right" bgcolor="#cc3300">JUMLAH PENGALI<br /> (Dalam Rupiah)</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Pribadi</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">480</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">1</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">270</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">2</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">120</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">3</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">120</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">4</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">90</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">5</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">90</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">6</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">90</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">7</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">60</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">8</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">60</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">9</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">60</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">10</td>\r\n<td height="20" align="right" bgcolor="#333333"><span class="contentgrid">60</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class="normalboldblue">Tabel Ilustrasi Bonus Belanja Rencana  Pengembangan Usaha</p>\r\n<p>Dalam Tabel berikut merupakan ilustrasi dengan asumsi seluruh  Distributor yang ada dalam team melakukan pembelanjaan 20 Bungkus</p>\r\n<table border="0" cellspacing="1" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td class="titlegrid" rowspan="2" width="18%" align="center" bgcolor="#cc3300">BELANJA</td>\r\n<td class="titlegrid" height="24" align="right" bgcolor="#cc3300">Jumlah Pengali</td>\r\n<td class="titlegrid" height="24" align="right" bgcolor="#cc3300">Jumlah Distributor</td>\r\n<td class="titlegrid" align="right" bgcolor="#cc3300">Jumlah  Pembelanjaan dalam Bungkus</td>\r\n<td class="titlegrid" height="24" align="right" bgcolor="#cc3300">Bonus Belanja</td>\r\n</tr>\r\n<tr>\r\n<td class="titlegrid" width="17%" height="24" align="right" bgcolor="#cc3300">Rp</td>\r\n<td class="titlegrid" width="19%" height="24" align="right" bgcolor="#cc3300">Orang</td>\r\n<td class="titlegrid" width="20%" align="right" bgcolor="#cc3300">Bungkus</td>\r\n<td class="titlegrid" width="26%" height="24" align="right" bgcolor="#cc3300">Rp</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Pribadi</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">480</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">1</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">20</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">9.600</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">Level 1</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">270</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">5</td>\r\n<td class="contentgrid" align="right" bgcolor="#282828">100</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">27.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Level 2</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">120</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">25</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">60.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">Level 3</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">120</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">12</td>\r\n<td class="contentgrid" align="right" bgcolor="#282828">2.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">300.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Level 4</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">90</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">625</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">12.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">1.125.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">Level 5</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">90</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">3.125</td>\r\n<td class="contentgrid" align="right" bgcolor="#282828">62.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">5.625.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Level 6</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">90</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">15.625</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">312.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">28.125.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">Level 7</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">60</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">78.125</td>\r\n<td class="contentgrid" align="right" bgcolor="#282828">1.562.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">93.750.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Level 8</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">60</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">390.625</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">7.812.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">468.750.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828">Level 9</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">60</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">1.953.125</td>\r\n<td class="contentgrid" align="right" bgcolor="#282828">39.062.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#282828">2.343.750.000</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333">Level 10</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">60</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">9.765.625</td>\r\n<td class="contentgrid" align="right" bgcolor="#333333">195.312.500</td>\r\n<td class="contentgrid" height="20" align="right" bgcolor="#333333">11.718.750.000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<h2>C. BONUS PENGEMBANGAN USAHA</h2>\r\n<p>Bonus Pengembangan Usaha yaitu bonus yang diberikan kepada  Distributor yang melakukan pengenalan usaha hingga kedalaman 10 Level  dibawahnya, Distributor akan mendapatkan Rp 2.500 untuk setiap  penambahan Distributor Baru.</p>\r\n<p><img src="http://fners.com/images/ilustrasi_bonuspengembangan.png" alt="" width="349" height="214" /></p>\r\n<p>&nbsp;</p>\r\n<h2>D. BONUS ROYALTI</h2>\r\n<p>Diberikan kepada seorang Distributor yang telah melakukan  aktifitas mengajak membina Distributor baru, Diberikan pada setiap  bulannya. Bonus Royalti terbagi atas Kelompok Distributor sebagai  berikut :</p>\r\n<p class="contenthighlight">RAIH BONUS ROYALTI</p>\r\n<p>Diberikan kepada seorang Distributor yang telah melakukan  aktifitas mengajak dan membina Distributor baru, Diberikan pada setiap  bulannya.</p>\r\n<p><img src="http://fners.com/images/ilustrasi_bonusroyalti.png" alt="" width="470" height="134" /></p>\r\n<p><span class="normalboldblue">Nilai Per Bungkus :</span> <br /> Adalah jumlah Rupiah Per Bungkus yang menjadi HAK bagi peraih  Royalti , Jumlah Rupiah dibedakan sesuai dengan Tingkatan Peraihan.</p>\r\n<p><span class="normalboldblue">Distributor Peraih :</span> <br /> Adalah Distributor yang meraih tingkatan Peraihan yang telah  ditetapkan.</p>\r\n<p>&nbsp;</p>\r\n<p class="contenthighlight">Tabel Tingkatan Peraihan dan Nilai Per  Bungkus</p>\r\n<table border="0" cellspacing="1" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td class="titlegrid" width="19%" height="24" align="left" bgcolor="#cc3300">Tingkat Peraihan</td>\r\n<td class="titlegrid" width="46%" height="24" align="left" bgcolor="#cc3300">Uraian</td>\r\n<td class="titlegrid" width="35%" align="left" bgcolor="#cc3300">Nilai  per Bungkus</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333"><img src="http://fners.com/images/gold1.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#333333">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 5.</td>\r\n<td class="contentgrid" align="left" bgcolor="#333333">Rp. 20,-</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828"><img src="http://fners.com/images/gold2.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#282828">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 6.</td>\r\n<td class="contentgrid" align="left" bgcolor="#282828">Rp. 10,-</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333"><img src="http://fners.com/images/gold3.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#333333">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 7.</td>\r\n<td class="contentgrid" align="left" bgcolor="#333333">Rp. 8,-</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828"><img src="http://fners.com/images/gold4.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#282828">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 8.</td>\r\n<td class="contentgrid" align="left" bgcolor="#282828">Rp. 5,-</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#333333"><img src="http://fners.com/images/gold5.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#333333">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 9.</td>\r\n<td class="contentgrid" align="left" bgcolor="#333333">Rp. 4,-</td>\r\n</tr>\r\n<tr>\r\n<td class="contentgrid" height="20" align="center" bgcolor="#282828"><img src="http://fners.com/images/gold6.png" alt="" width="91" height="124" /></td>\r\n<td class="contentgrid" height="20" align="left" bgcolor="#282828">Memiliki  downline langsung minimal 5 dan terduplikasi hingga kedalaman Level 10.</td>\r\n<td class="contentgrid" align="left" bgcolor="#282828">Rp. 3,-</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class="contenthighlight">&nbsp;</p>\r\n<p>&nbsp;</p>', 'PO. KHARISMA NAGA PERSADA (PT.FLAHNET int)', 'point operator  PT.FLASHNET international', '2010-08-27 09:19:52', '', 0, 1),
